INSERT INTO `cc1_content` VALUES (1,37,'About Us','about-cathys-critters','','<div class=\"art-postcontent\">\r\n<div>\r\n<h1>We bring the Farm to you!</h1>\r\nCathy’s Critters is in the business of providing quality experiences with animals for kids, parents, and the community.  Our belief is that one-on-one contact with animals, including coaching in care, feeding and being gentle, helps children develop a sense of empathy and connectedness with their world.\r\n<p><img src=\"images/p9223255.jpg\" border=\"0\" width=\"212\" height=\"253\" style=\"border: 0; float: left;\" /></p>\r\n<p> </p>\r\n<p>We offer several services to accomplish this:</p>\r\n<ul>\r\n<li><a href=\"index.php/events/petting-zoos\" target=\"_blank\">Petting Zoos </a>and/or <a href=\"index.php/events/pony-rides\" target=\"_blank\">Hand-led Pony Rides</a></li>\r\n<li><a href=\"index.php/events/educational-presentations\" target=\"_blank\">Indoor exotic animal presentations to small and large groups</a></li>\r\n<li><a href=\"index.php/events/critter-camp\" target=\"_blank\">Critter Camp, a week-long adventure on the farm</a></li>\r\n<li><a href=\"index.php/events/special-events\" target=\"_blank\">Farm Visits</a></li>\r\n<li><a href=\"index.php/events/educational-presentations\" target=\"_blank\">Goat milking hands-on demonstrations and lessons</a></li>\r\n<li><a href=\"index.php/events/critter-camp\" target=\"_blank\">Animals for Nativity Scenes</a></li>\r\n<li><a href=\"index.php/events/special-events\" target=\"_blank\">Animal Leasing and Sales</a></li>\r\n</ul>\r\n<p> </p>\r\n<p><img src=\"images/photo%20souvenir%20example4.jpg\" border=\"0\" width=\"183\" height=\"232\" style=\"border: 0; float: right;\" /></p>\r\n<h2> </h2>\r\n<h2> </h2>\r\n<h2>Photo Souvenirs</h2>\r\n<p>We also offer \"Photo Souvenirs\" at any private event (for an additional fee). A photographer will come to your event and take a picture of each of your guests with their favorite animal. The picture will be printed at the event and put into 4x6 photo folders for giving out as party favors. If you would like to add Photo Souvenirs to your event, just select it when you fill out the contract!</p>\r\n<p> </p>\r\n<p> </p>\r\n<p>We hope you’ll enjoy any activity you choose to engage in with our team of animals and dedicated employees.  Please enjoy the rest of the site and don’t forget to sign up for our occasionally-published newsletter and follow us on Twitter and Facebook!</p>\r\n</div>\r\n</div>','',0,0,0,10,'2011-12-22 04:49:16',42,'','2012-12-11 17:42:40',57,0,'0000-00-00 00:00:00','2011-12-22 04:49:16','0000-00-00 00:00:00','','','{\"show_title\":\"\",\"link_titles\":\"\",\"show_intro\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"alternative_readmore\":\"\",\"article_layout\":\"\"}',24,0,2,'','',1,13317,'{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}',0,'*','');
INSERT INTO `cc1_content` VALUES (2,38,'Who We Are','employee-introductions','','<div class=\"item-page\">\r\n<div class=\"art-post\">\r\n<div class=\"art-post-body\">\r\n<div class=\"art-post-inner\">\r\n<div class=\"art-postcontent\">\r\n<div class=\"art-article\">\r\n<h1>Employees<img src=\"images/employees/dscn6956.jpg\" border=\"0\" alt=\"\" width=\"221\" height=\"178\" align=\"right\" /></h1>\r\n<p>Cathy\'s Critters is proud of our employees, who are all dedicated to the cause of teaching kids about animals, science, and our ecosystem.  We couldn\'t serve our customers or take care of our menagerie without them, so we\'d like to introduce you to them in this space. Be sure to say hey to them the next time they are at your event!</p>\r\n<p> </p>\r\n<p><img src=\"images/employees/pony.jpg\" border=\"0\" width=\"196\" height=\"186\" style=\"border: 0; float: left;\" /></p>\r\n<h4>Cathy Smith</h4>\r\n<p>Cathy is the founder and namesake of Cathy\'s Critters. A degreed zoologist, she has been an animal lover and protector from a very young age when she encouraged the first dog to follow her home. She conceived of the idea of bringing her pets to the public in early 2005 and since then has designed feeding and care programs for all the species that she keeps. Her current jobs in the business are Head Curator (keeps the animals healthy and designs teaching material for presentations) and Customer Fulfillment Manager (oversees the delivery of programs to our clients).</p>\r\n<p> </p>\r\n<h4>Kevin Smith<img src=\"images/employees/kevin.png\" border=\"0\" alt=\"\" width=\"183\" height=\"138\" align=\"right\" /></h4>\r\n<p>Kevin, Cathy’s husband, spends part of his time in his own profession as an electronics designer, and part of his time at Cathy’s Critters.  He does a huge amount of support work to keep things running smoothly on the farm including helping with design and building of animal housing, running the web site, and acting as photographer at some events.</p>\r\n<p> </p>\r\n<h4><img src=\"images/employees/lisapic.jpg\" border=\"0\" width=\"154\" height=\"158\" style=\"border: 0; float: left;\" /></h4>\r\n<h4>Lisa Cass</h4>\r\n<p>Lisa is the Office Manager at Cathy’s Critters, and is the one who makes it all come together. Lisa\'s main job at the farm is to schedule the events and communicate with the customers. She knows what each event requires, keeps customers satisfied, and schedules the employee teams (Critter Crews). Lisa also goes out on petting zoo events and conducts educational presentations.  She has been with the company from the beginning, and keeps the rest of us sane when crazy times inevitably come along. Contact the office and talk to Lisa to book your next event!</p>\r\n<p> </p>\r\n<h4>April Smith<img src=\"images/employees/april.jpg\" border=\"0\" width=\"148\" height=\"186\" style=\"border: 0; float: right;\" /></h4>\r\n<p>April, Cathy\'s daughter, is the Farm Manager at Cathy\'s Critters as well as an animal education expert and petting zoo team leader. She is one girl who knows it all! April\'s job on the farm is to help Cathy care for the animals, including feeding, cleaning and vet work, as well as put up barns and homes for everyone. A few of her many talents include welding, ferrying and reptile care. She has a big smile and does her best to make every event memorable.</p>\r\n<p> </p>\r\n<p><img src=\"images/employees/dscn2813.jpg\" border=\"0\" width=\"186\" height=\"180\" style=\"border: 0; float: left;\" /></p>\r\n<h4>Casey Smith</h4>\r\n<p>Casey, Cathy\'s son, is the Maintenance Technician as well as a petting zoo team leader. His main job on the farm is making sure all of our trucks, trailers, tractors and any other equipment is running smoothly and safely. At petting zoos, he loves interacting with the kids and always gets great customer reviews for being so friendly. He is currently studying computer support in college and loves to play video games.</p>\r\n<h4> </h4>\r\n<h4><img src=\"images/employees/karen2.jpg\" border=\"0\" width=\"160\" height=\"186\" style=\"border: 0; float: right;\" /></h4>\r\n<h4>Karen Reed</h4>\r\n<p>Karen Reed is our Business Consultant as well as a Rabbit caretaker. Our business has grown so much in the past year thanks to Karen! She is very inventive and constantly thinking of new ways to improve the company and how everything is run. Karen has a business degree and a love of animals. She has a small farm of her own, but still loves coming to Cathy\'s Critters and helping out whenever we need her! Karen doesn\'t go to very many petting zoos, but it\'s a treat when she does!</p>\r\n<p> </p>\r\n<h4><img src=\"images/employees/cap.jpg\" border=\"0\" width=\"190\" height=\"176\" style=\"border: 0; float: left;\" />Cap Hopkins</h4>\r\n<p>Cap has been with Cathy\'s Critters for close to two years. She has a passion for taking care of animals, even helping to handle and care for them voluntarily at times, and has come to know the in and out of petting zoos. Currently, she is going to Collin College and working on getting her drivers license so she can begin to be trained as a team leader. She also has website experience and is helping make this site even better for our visitors. This past Summer, she worked as a Critter Camp Counselor and the kids loved her!</p>\r\n<p> </p>\r\n<h4><img src=\"images/employees/nichole.jpg\" border=\"0\" alt=\"\" width=\"184\" height=\"193\" align=\"right\" /></h4>\r\n<h4>Nichole Anderson</h4>\r\n<p>Here at Cathy\'s Critters, Nichole is a petting zoo attendant, team leader trainee and animal caretaker. She comes a few days a week to clean our exotic animal cages and then works petting zoos on the weekend. Currently, she is in her senior year at McKinney High School. Nichole has a very sweet personality and is quick to smile. She works really well as a pony walker and does a great job interacting with the kids.</p>\r\n<p> </p>\r\n<h4><img src=\"images/employees/robert.jpg\" border=\"0\" alt=\"\" width=\"144\" height=\"180\" align=\"left\" /></h4>\r\n<h4> </h4>\r\n<h4>Robert Gildner</h4>\r\n<p>Robert lives down the road from Cathy\'s Critters farm and has been working with us off and on since the beginning. He has a lot of animals of his own, so he\'s grown up handling and caring for them. He is very patient with children and will not hesitate to help someone hold a rabbit or chicken. He frequently goes to petting zoos as a volunteer and will help out around the farm when he has the free time. He is currently going to McKinney North High School.</p>\r\n<h4><img src=\"images/employees/lizzie.jpg\" border=\"0\" alt=\"\" width=\"137\" height=\"182\" align=\"right\" /></h4>\r\n<p> </p>\r\n<h4>Lizzie Adam</h4>\r\n<p>Although Lizzie has only been with Cathy\'s Critters since Spring of 2012, she has quickly made herself an important part of our team. Not only does she go to petting zoos, she also comes to the farm to feed and care for the animals. She always stays after her scheduled work time and voluntarily interacts with our exotic animals - especially the reptiles! She is a little shy, but has a sweet personality and is very patient with customers at the petting zoos.</p>\r\n<p> </p>\r\n<h4><img src=\"images/employees/ashley.jpg\" border=\"0\" alt=\"\" width=\"215\" height=\"161\" align=\"left\" />Ashley Burleson</h4>\r\n<p>Ashley started off with Cathy\'s Critters as an animal caretaker, but has recently been moved into the position of petting zoo attendant. She comes a few days a week to feed and care for the animals and does a very thorough job. She always double checks her work and will take the time to love on some of the animals. At petting zoos, Ashley\'s personality has really opened up. She is extremely kind and helpful to the children and is quick to help an employee with anything they need.</p>\r\n<p> </p>\r\n<h4>Elizabeth Akin<img src=\"images/employees/elizabeth.jpg\" border=\"0\" alt=\"\" width=\"203\" height=\"152\" align=\"right\" /></h4>\r\n<p>Elizabeth began working with Cathy\'s Critters in the Spring and we quickly found out she was an exotic animal lover. She will always interact with the exotic critters here at the farm, but has a ton of her own at home. Currently, she works as a petting zoo attendant. She is quick to laugh at funny things the animals do inside the petting zoos and will always help a child hold a cute rabbit.</p>\r\n<p> </p>\r\n<h4>Natalee Williams</h4>\r\n<p>Natalee is a petting zoo attendant at Cathy\'s Critters and is a huge animal lover. She is a great chicken catcher and has a lot of unique interests - including bone collecting! This past Summer, she came to Critter Camp and used her collection of bones to do an educational presentation for each of the kids. Natalee is physically short, but has a tall personality.</p>\r\n<p> </p>\r\n<h4>Ty Hopper</h4>\r\n<p>Attendant, dancer, mentor to aspiring white hip-hoppers everywhere.</p>\r\n<p> </p>\r\n<p> </p>\r\n<h4>Attendant</h4>\r\n<p>Filler text - insert bio here!</p>\r\n<p> </p>\r\n<h4>Attendant</h4>\r\n<p>Filler text - insert bio here!</p>\r\n<p> </p>\r\n<h4>Attendant</h4>\r\n<p>Filler text - insert bio here!</p>\r\n<p> </p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<p> </p>','',1,0,0,10,'2011-12-22 22:03:44',42,'','2012-12-20 22:40:34',42,0,'0000-00-00 00:00:00','2011-12-22 22:03:44','0000-00-00 00:00:00','','','{\"show_title\":\"\",\"link_titles\":\"\",\"show_intro\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_layout\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}',23,0,3,'','',1,1723,'{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}',0,'*','');
INSERT INTO `cc1_content` VALUES (3,39,'Educational Presentations','educational-presentations','','<div class=\"art-postcontent\">\r\n<div class=\"art-article\">\r\n<div>\r\n<h2>Educational live animal presentations</h2>\r\n<p>Cathy\'s passion is education and using human-animal interaction to help kids learn about empathy, gentleness, and science. Our indoor presentations can be tailored to the interest of your guests. We have two suggestions for birthday parties and homeschool clubs, and two for larger venues (schools, churches, libraries). These parties are good for rain or shine and can even be substituted for an outdoor petting zoo if your outdoor plans are threatened by rotten weather.</p>\r\n<h3>Tailored to your group</h3>\r\n<p>For small groups and especially for entertainment, we offer \"I Dare You\" and \"Gentle and Fluffy\" packages.</p>\r\n<p>For large assemblies we can present \"Worldwide Safari\" or \"A Day on The Farm\", designed to convey educational material about animals and ecosystems in a fun and entertaining way.</p>\r\n<p>Our material is aligned with Texas educational standards (TEKS) and is tailored to be age-appropriate depending on the audience. The program is half instructional, and half hands-on, giving the students plenty of interaction with a variety of critters including snakes, tortoises, pot-bellied pigs, hedgehogs, a wallaby, birds, guinea pigs and more!</p>\r\n<h3>Large groups (16+ kids)</h3>\r\n<h4>Worldwide Safari</h4>\r\n<p>Your host has gone to almost every continent and brought back specimens for us to study. Join her as she tells stories about how these fascinating animals live in nature, how their adaptations enable them to survive in their environment, and how they differ from each other in terms of raising their young, finding food, and walking, burrowing, or gliding around their environment.</p>\r\n<ul style=\"list-style-type: circle;\">\r\n<li>\r\n<p>Auditorium presentation<object width=\"320\" height=\"240\" classid=\"clsid:02bf25d5-8c17-4b23-bc80-d3488abddc6b\" align=\"right\"><param name=\"src\" value=\"media/video/WWSPromo.mov\" /><param name=\"autoplay\" value=\"false\" /><param name=\"kioskmode\" value=\"true\" /><param name=\"scale\" value=\"tofit\" /><embed width=\"320\" height=\"240\" type=\"video/quicktime\" src=\"media/video/WWSPromo.mov\" autoplay=\"false\" kioskmode=\"true\" scale=\"tofit\" align=\"right\" /></object></p>\r\n</li>\r\n<li>\r\n<p>8 animals</p>\r\n</li>\r\n<li>\r\n<p>Wireless mic &amp; sound system included</p>\r\n</li>\r\n<li>\r\n<p>Schools</p>\r\n</li>\r\n<li>\r\n<p>Churches</p>\r\n</li>\r\n<li>\r\n<p>Llibraries</p>\r\n</li>\r\n<li>\r\n<p>Corporate Gatherings</p>\r\n</li>\r\n<li>\r\n<p>Starting at $295 for a 1-hour presentation</p>\r\n</li>\r\n</ul>\r\n<p><a href=\"http://www.youtube.com/watch?v=N9i5EEjW9YI\" title=\"WorldWide Safari presentation in Irving, TX\">See it at YouTube</a></p>\r\n<p> </p>\r\n<p> </p>\r\n<h3>Small groups (5-15 kids)</h3>\r\n<h4><img src=\"images/kidsandanimals/idy.jpg\" border=\"0\" alt=\"Critter camper with Speedy the corn snake\" title=\"No herpetophobia here!\" width=\"239\" height=\"384\" style=\"float: left; margin-left: 25px; margin-right: 25px;\" /></h4>\r\n<h4> </h4>\r\n<h4>I Dare You!</h4>\r\n<ul style=\"list-style-type: circle;\">\r\n<li>\r\n<p>Fearsome creatures: snakes, lizards, spiny hedgehogs</p>\r\n</li>\r\n<li>\r\n<p>Up close and personal</p>\r\n</li>\r\n<li>\r\n<p>Conquer fears</p>\r\n</li>\r\n<li>\r\n<p>Have fun!</p>\r\n</li>\r\n<li>\r\n<p>For small indoor playgroups with lots of learning and handling</p>\r\n</li>\r\n<li>\r\n<p>From $295 for 1 hour, up to 15 kids</p>\r\n</li>\r\n</ul>\r\n<p> </p>\r\n<p> </p>\r\n<p> </p>\r\n<p> </p>\r\n<p> </p>\r\n<h4><img src=\"images/kidsandanimals/gnfl.jpg\" border=\"0\" width=\"266\" height=\"361\" style=\"border: 0; float: right;\" /></h4>\r\n<h4> </h4>\r\n<h4>Gentle and Fluffy</h4>\r\n<ul style=\"list-style-type: circle;\">\r\n<li>\r\n<p>Sugar and Spice of the animal world</p>\r\n</li>\r\n<li>\r\n<p>Bunnies, chicks, guinea pigs, chinchillas, and more</p>\r\n</li>\r\n<li>\r\n<p>Great for small playgroup activity - educational and hands-on</p>\r\n</li>\r\n<li>\r\n<p>From $295 for 1 hour, up to 15 kids</p>\r\n</li>\r\n</ul>\r\n</div>\r\n</div>\r\n</div>','',1,0,0,9,'2011-12-22 22:07:33',42,'','2013-02-17 16:39:43',42,0,'0000-00-00 00:00:00','2011-12-22 22:07:33','0000-00-00 00:00:00','','','{\"show_title\":\"\",\"link_titles\":\"\",\"show_intro\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_layout\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}',35,0,6,'','',1,1247,'{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}',0,'*','');
INSERT INTO `cc1_content` VALUES (4,40,'Petting Zoos','petting-zoos','','<p> </p>\r\n<h1 style=\"text-align: center;\">We Bring the Farm to You</h1>\r\n<p>Select the package to suit the ages of the children and number of guests.  We have a petting zoo package (with or without pony rides) for any event from a few toddlers and their parents at a backyard birthday party to a multi-hour carnival at your school or city park (check with your city regarding local permits or ordinances regarding animal exhibitions on public or private property).</p>\r\n<p> </p>\r\n<h1><img src=\"images/kidsandanimals/girl_feeding_piglet_192x256.jpg\" border=\"0\" alt=\"girl feeding piglet 192x256\" width=\"210\" height=\"281\" style=\"margin-left: 32px; margin-right: 32px; float: left;\" /></h1>\r\n<h4> </h4>\r\n<h2><span style=\"font-size: large;\">Babies for Babies</span></h2>\r\n<ul>\r\n<li>\r\n<p><span style=\"font-size: medium;\">Cutest of the cute - lots of baby animals</span></p>\r\n</li>\r\n<li>\r\n<p><span style=\"font-size: medium;\">1-2 bottle-fed piglets or goat kids</span></p>\r\n</li>\r\n<li>\r\n<p><span style=\"font-size: medium;\">Plus rabbits, guinea pigs, goats, chicks, chicken, duck</span></p>\r\n</li>\r\n<li>\r\n<p><span style=\"font-size: medium;\">Kids get a chance to bottle feed</span></p>\r\n</li>\r\n<li>\r\n<p><span style=\"font-size: medium;\">Accommodates maximum of 20 guests<br /></span></p>\r\n</li>\r\n<li>\r\n<p><span style=\"font-size: medium;\">Starting at $340 for 1-1/2 hours</span></p>\r\n</li>\r\n</ul>\r\n<p> </p>\r\n<p> </p>\r\n<h2>Little Rancher<img src=\"images/kidsandanimals/girl_feeding_llama_256.jpg\" border=\"0\" alt=\"girl feeding llama 256\" width=\"256\" height=\"192\" style=\"margin-left: 3px; float: right;\" /></h2>\r\n<ul>\r\n<li>\r\n<p><span style=\"font-size: medium;\">Most popular birthday party package</span></p>\r\n</li>\r\n<li>\r\n<p><span style=\"font-size: medium;\">Llama, larger goats<br /></span></p>\r\n</li>\r\n<li>\r\n<p><span style=\"font-size: medium;\">Plus rabbits, guinea pigs, chicks, </span><span style=\"font-size: medium;\">chickens, ducks</span></p>\r\n</li>\r\n<li>\r\n<p><span style=\"font-size: medium;\">Accommodates maximum of 20 guests<br /></span></p>\r\n</li>\r\n<li>\r\n<p><span style=\"font-size: medium;\">Starting at $340 for 1-1/2 hours</span></p>\r\n</li>\r\n</ul>\r\n<p> </p>\r\n<h4><img src=\"images/kidsandanimals/girl_in_blue_and_donkey_256.jpg\" border=\"0\" alt=\"girl in blue and donkey 256\" width=\"229\" height=\"276\" style=\"margin-right: 20px; float: left;\" /></h4>\r\n<h2><span style=\"font-size: large;\">Big Tex<br /></span></h2>\r\n<ul>\r\n<li><span style=\"font-size: medium;\">Best package for large private parties or small festivals</span></li>\r\n<li><span style=\"font-size: medium;\">Llama plus another large animal for petting (donkey or mini-zebu)<br /></span></li>\r\n</ul>\r\n<ul>\r\n<li class=\"_mce_tagged_br\"><span style=\"font-size: medium;\">Goats, rabbits, guinea pigs, chicks, chickens, ducks<br /></span></li>\r\n</ul>\r\n<ul>\r\n<li class=\"_mce_tagged_br\"><span style=\"font-size: medium;\">Similar to Little Rancher but larger enclosure, more animals, and more attendants</span></li>\r\n<li class=\"_mce_tagged_br\"><span style=\"font-size: medium;\">Accommodates maximum of 40 guests<br /></span></li>\r\n</ul>\r\n<ul>\r\n<li class=\"_mce_tagged_br\"><span style=\"font-size: medium;\">Starting at $405 for 1-1/2 hours</span></li>\r\n</ul>\r\n<h4> </h4>\r\n<p> </p>\r\n<h2><span style=\"font-size: large;\">Super Tex</span></h2>\r\n<p><img src=\"images/kidsandanimals/girl_and_dad_and_goats_256.jpg\" border=\"0\" alt=\"girl and dad and goats 256\" width=\"253\" height=\"190\" style=\"float: right;\" /></p>\r\n<ul>\r\n<li>\r\n<p><span style=\"font-size: 12pt;\">For large festivals and fairs (city-wide Easter Egg hunts, balloon festivals, large school carnivals)<br /></span></p>\r\n</li>\r\n<li>\r\n<p><span style=\"font-size: 12pt;\">Three large animals in separate pens<br /></span></p>\r\n</li>\r\n</ul>\r\n<ul>\r\n<li class=\"_mce_tagged_br\">\r\n<p><span style=\"font-size: 12pt;\">Lots of goats, rabbits, guinea pigs, chicks, chickens, ducks<br /></span></p>\r\n</li>\r\n</ul>\r\n<ul>\r\n<li class=\"_mce_tagged_br\">\r\n<p><span style=\"font-size: 12pt;\">Separate \"ENTER\" and \"EXIT\" gates for improved traffic flow<br /></span></p>\r\n</li>\r\n<li class=\"_mce_tagged_br\">\r\n<p><span style=\"font-size: 12pt;\">Extra attendants to keep kids and animals safe</span></p>\r\n</li>\r\n<li class=\"_mce_tagged_br\">\r\n<p><span style=\"font-size: 12pt;\">Accommodates maximum 60 guests<br /></span></p>\r\n</li>\r\n</ul>\r\n<ul>\r\n<li class=\"_mce_tagged_br\">\r\n<p><span style=\"font-size: 12pt;\">Starting at $740 for 2 hours</span></p>\r\n</li>\r\n</ul>\r\n<h4> </h4>','',1,0,0,9,'2011-12-22 22:07:33',42,'','2013-05-01 17:48:22',57,0,'0000-00-00 00:00:00','2011-12-22 22:07:33','0000-00-00 00:00:00','','','{\"show_title\":\"\",\"link_titles\":\"\",\"show_intro\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_layout\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}',43,0,7,'','',1,3174,'{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}',0,'*','');
INSERT INTO `cc1_content` VALUES (5,41,'Pony Rides','pony-rides','','<h1>Giddy-up!</h1>\r\n<p>Pony rides can be booked as the sole entertainment for a birthday party, but consider reserving the petting zoo and pony for double the fun!  Our ponies are gentle and well-behaved, having been \"working\" in this career all their lives.</p>\r\n<p>We offer hand-led pony rides in the venue of your choice: back yard, front side walk, back alley, or any other place that wants a pony ride! Whether you have a child who dreams pony dreams, or an aspiring cowboy, consider cowboy hat souvenirs and a Cathy\'s Critters pony party.</p>\r\n<h2>Our ponies</h2>\r\n<p> </p>\r\n<h4><img src=\"images/dallas.jpg\" border=\"0\" alt=\"\" width=\"145\" height=\"192\" align=\"left\" /></h4>\r\n<h4> </h4>\r\n<h4>Dallas</h4>\r\n<p>Dallas was a \"pony rides pony\" even before he came to Cathy\'s Critters in 2005.  With a name like \"Dallas\", of course he\'d be a Stars fan. Although he can be stubborn, Dallas is a very calm and gentle pony and is great at big events.</p>\r\n<p> </p>\r\n<p> </p>\r\n<h4> </h4>\r\n<h4>Angel<img src=\"images/animals/angel.jpg\" border=\"0\" alt=\"\" width=\"200\" height=\"186\" align=\"right\" /></h4>\r\n<p>Angel is small and spunky. She is one of the ponies that has a smaller weight limit than the others, so she is perfect for younger birthday parties and smaller events. She has mothered quite a few little ponies that have been given new homes and is extremely sweet with the kids. </p>\r\n<p> </p>\r\n<p> </p>\r\n<h4><img class=\"caption\" src=\"images/ponies/310_bigal.jpg\" border=\"0\" alt=\"Big Al from Kiss FM and \" title=\"Big Al offers pony rides at Kiss FM \" width=\"210\" height=\"158\" style=\"border: 0; float: left;\" /></h4>\r\n<h4> </h4>\r\n<h4>Stormy</h4>\r\n<p>Stormy is a beautiful painted pony who has given us two foals: Rain and Typhoon. Her name comes from the markings on her body and came to us from a home that took very good care of her. She is a reliable pony and doesn\'t spook easily, so she is perfect for larger events.</p>\r\n<p> </p>\r\n<h4> </h4>\r\n<h4>Cowboy<img src=\"images/cowboy.jpg\" border=\"0\" alt=\"\" width=\"224\" height=\"153\" align=\"right\" /></h4>\r\n<p>Cowboy is a dark brown Shetland pony that loves to work. He is most often seen at large events because he is so calm and can hold a lot of children. He is very sweet to everyone who comes to love on him. He tends to be stubborn sometimes, but our firm care is teaching him to be an amazing pony for rides.</p>\r\n<h4> </h4>\r\n<h4><img src=\"images/sedona.jpg\" border=\"0\" alt=\"\" width=\"203\" height=\"142\" align=\"left\" /></h4>\r\n<h4>Sedona</h4>\r\n<p>Sedona is a small, very sweet pony. She has a low weight limit, but is perfect for younger children because of her calm temperament. An interesting fact about her is that she is blind in one eye, but that doesn\'t stop her from working and being such a sweetheart!</p>\r\n<p> </p>\r\n<h4><img src=\"images/cinnamon.jpg\" border=\"0\" alt=\"\" width=\"131\" height=\"195\" align=\"right\" /></h4>\r\n<h4> </h4>\r\n<h4>Cinnamon</h4>\r\n<p>Cinnamon has been with Cathy\'s Critters for years - almost as long as Dallas. She has also mothered some sweet ponies that have found good homes. Cinnamon is very calm, but doesn\'t go out very much anymore. Her name comes from her pretty light brown color that made us think of Cinnamon.</p>\r\n<h4> </h4>\r\n<h4><img src=\"images/animals/buddy.jpg\" border=\"0\" alt=\"\" width=\"137\" height=\"207\" align=\"left\" /></h4>\r\n<h4> </h4>\r\n<h4>Buddy</h4>\r\n<p> </p>','',1,0,0,9,'2011-12-22 22:07:33',42,'','2013-01-20 22:54:06',42,0,'0000-00-00 00:00:00','2011-12-22 22:07:33','0000-00-00 00:00:00','','','{\"show_title\":\"\",\"link_titles\":\"\",\"show_intro\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_layout\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}',20,0,8,'','',1,1176,'{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}',0,'*','');
INSERT INTO `cc1_content` VALUES (6,42,'Critter Camp','critter-camp','','<h1>Critter Camp</h1>\r\n<p>Cathy’s Critters’ on-going mission is to educate kids and families about rural life, science, our food supply, and America\'s agrarian roots. We want to instill a sense of belonging to our world through farming and a better understanding of the natural world in which we live, and which gives us life. <br /><br /> 2013 will be our 4th summer of offering \"Critter Camp\", a week-long exploration of the farm, animal care, science, fun, and games. There will be tons more games, activities and even a \"Friday Night Food &amp; Fun!\"</p>\r\n<h2><img src=\"images/crittercamp/fishing_72dpi.jpg\" border=\"0\" width=\"288\" height=\"216\" style=\"float: left;\" /></h2>\r\n<h2><strong>Schedule</strong></h2>\r\n<table style=\"width: 213px; height: 169px;\" border=\"0\">\r\n<tbody>\r\n<tr>\r\n<td style=\"text-align: center;\">\r\n<h5><span style=\"color: #3366ff;\"><strong>Critter Camp 2013 Dates</strong></span></h5>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td><strong>Session 1</strong>: June 17 - 21, 2013</td>\r\n</tr>\r\n<tr>\r\n<td><strong>Session 2</strong>: June 24 - 28, 2013</td>\r\n</tr>\r\n<tr>\r\n<td><strong>Session 3</strong>: July 15 - 19, 2013</td>\r\n</tr>\r\n<tr>\r\n<td><strong>Session 4</strong>: July 29 - Aug 2, 2013</td>\r\n</tr>\r\n<tr>\r\n<td><strong>Session 5</strong>: Aug 12 - 16, 2013</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p> </p>\r\n<h2>Details</h2>\r\n<p>Critter Camp 2013 will be open to ages 5 - 12. The age groups will be split into Cria Kids (5 - 7, all five years old <strong>must</strong> have at least 1 year in Kindergarten to be allowed at Critter Camp) and Critter Campers (8 - 12). Critter Camp will run from 9 am - 5 pm each day. The fee per camper is $260 for the first child and $230 for additional children from the same family. We are also offering an optional half day camp from 9 am - 1 pm for Cria Kids at the price of $200 ($180 for additional children from the same family) for the week.</p>\r\n<p>Updated: Unfortunately, Cathy\'s Critters will *not* be offering an Overnight Camp-out for Critter Camp 2013. Instead, we are going to have a \"Friday Night Food &amp; Fun\" here at Cathy\'s Critters farm. At the end of each camp week, Critter Camp wants to invite the parents and siblings of our campers to the farm Friday night from 5 - 7 pm for some food and a show! The campers will put on a skit for their families and we will have a small ceremony to award certificates and prizes to some of our campers for their special skills during the week. There will also be a free petting zoo set up for the kids (campers and siblings) to enjoy! We are asking for a $5 donation per adult ( $3 per child besides the campers) to help cover the cost of food and drinks!</p>\r\n<h2>Activities</h2>\r\n<h1><img src=\"images/crittercamp/josie%20feeding%20roo_smallest.jpg\" border=\"0\" width=\"162\" height=\"121\" style=\"float: left;\" /></h1>\r\n<p><strong>Animal Care of Farm and Exotic Animals:</strong> Campers will be farm hands every morning, helping with feeding, brushing, hoof-trimming, and other chores they might be missing out on at home. <br /><br /> <strong>Horse Care:</strong> grooming, safety, equipment, health, types of riding, and games you can play on horseback.<br /><br /> <strong>Goat-Milking:</strong> Hands-on practice and more information about dairy farms and products. We\'ll make and eat homemade cheese and ice cream.<br /><br /><img src=\"images/crittercamp/goatmilking.jpg\" border=\"0\" width=\"200\" height=\"150\" style=\"float: right;\" /></p>\r\n<p><strong>Science:</strong> Microscope exploration of pond water, solar power, others.</p>\r\n<p><br /> <strong>Crafts and Games:</strong>  Wheel pottery, scrap booking, team games, and good old-fashioned summer camp bonding.<br /><br /> <strong>Organic Gardening:</strong> Help plant and fertilize with farm-made compost, start seedlings, and learn about the cycle by which animals help fertilize the plants, and plants nourish the animals.</p>\r\n<p> </p>\r\n<h4 style=\"text-align: center;\">Call Cathy\'s Critters office at 972-562-0583 today to reserve a spot for your child at Critter Camp 2013!</h4>\r\n<p>Download files for registration here:</p>\r\n<p><a href=\"media/doc/CritterCampRegistrationForm_2013.pdf\" target=\"_blank\" title=\"Critter Camp Registration Form\">Critter Camp 2013 Registration Form (Required)</a></p>\r\n<p><a href=\"media/doc/HealthInfoForm.pdf\" target=\"_blank\" title=\"Health Information Form\">Health Info (Required)</a></p>\r\n<p><a href=\"media/doc/ReleaseAndLiabilityWaiver.pdf\" target=\"_blank\" title=\"Release and Liability Waiver\">Release and Liability Waiver (Required)</a></p>\r\n<p><a href=\"media/doc/CCJrCounselorApplication.pdf\" target=\"_blank\" title=\"Junior Counselor Application\">Critter Camp Junior Counselor Application (Optional)</a></p>','',1,0,0,9,'2011-12-22 22:07:33',42,'','2013-05-01 14:56:12',57,0,'0000-00-00 00:00:00','2011-12-22 22:07:33','0000-00-00 00:00:00','','','{\"show_title\":\"\",\"link_titles\":\"\",\"show_intro\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_layout\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}',29,0,9,'','',1,2044,'{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}',0,'*','');
INSERT INTO `cc1_content` VALUES (7,43,'Event confirmation email - private petting zoo','confirmation-email-priv-pzpr','','<p>{cc1_critters_reservations___firstname},</p>\r\n<p>Thanks for booking Cathy\'s Critters for your event!  We\'re proud and excited to have you for a customer.  Please double-check the following information.  Our office will be calling within the next business day to confirm details and confirm deposit payment arrangements.</p>\r\n<p>Name: {cc1_critters_reservations___firstname} {cc1_critters_reservations___lastname}</p>\r\n<p>Contact address:</p>\r\n<p>    {cc1_critters_reservations___address1}</p>\r\n<p>    {cc1_critters_reservations___address2}</p>\r\n<p>    {cc1_critters_reservations___city}</p>\r\n<p>    {cc1_critters_reservations___state}</p>\r\n<p>    {cc1_critters_reservations___zipcode}</p>\r\n<p>Phone:</p>\r\n<p>    {cc1_critters_reservations___phone1}</p>\r\n<p>    {cc1_critters_reservations___phone2}</p>\r\n<p>Party description:</p>\r\n<p>    {cc1_critters_reservations___reservations_partydate}</p>\r\n<p>    {cc1_critters_reservations___reservations_partytime}</p>\r\n<p>    {cc1_critters_reservations___package_basetype} with {cc1_critters_reservations___package_numponies} ponies</p>\r\n<p>  </p>','',1,0,0,8,'2011-12-30 14:45:53',42,'','2012-03-20 02:34:41',42,0,'0000-00-00 00:00:00','2011-12-30 14:45:53','0000-00-00 00:00:00','','','{\"show_title\":\"\",\"link_titles\":\"\",\"show_intro\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"alternative_readmore\":\"\",\"article_layout\":\"\"}',10,0,1,'','',1,51,'{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}',0,'*','');
