INSERT INTO `cc1_content` VALUES (9,47,'Thanks for visiting, but...','thanks-for-visiting-but','','<p>You have stumbled upon Cathy\'s Critters\' new web site which is under development.  I\'m assuming you probably typed http://www.petsupervisor.com in the menu bar of your browser.</p>\r\n<p>We\'re flattered that you knew who to come to for animal education services in North Texas, but we\'re not quite ready at this address yet.</p>\r\n<p>Please use this link to go to our fully-functional web site to book your next event and get contact information for our office:</p>\r\n<p><a href=\"http://www.cathys-critters.com\" target=\"_self\" title=\"Cathy\'s Critters\">www.cathys-critters.com</a></p>\r\n<p>Thanks!</p>\r\n<p>--</p>\r\n<p>Webmaster</p>','',0,0,0,10,'2012-08-23 00:37:09',42,'','2012-11-02 15:21:59',42,0,'0000-00-00 00:00:00','2012-08-23 00:37:09','0000-00-00 00:00:00','','','{\"show_title\":\"\",\"link_titles\":\"\",\"show_intro\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"alternative_readmore\":\"\",\"article_layout\":\"\"}',2,0,1,'','',1,1257,'{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}',0,'*','');
INSERT INTO `cc1_content` VALUES (10,48,'Private party - terms and conditions','terms-and-conditions-private-event','','<h2>Please read carefully.  Your submission of this booking form constitutes a contract and the following are among the terms of that contract.</h2>\r\n<p> </p>\r\n<p>Cathy\'s Critters needs convenient parking. We must be able to locate the trailer within 200 ft of the setup area at all times during your event. For the initial set up (30-45 minutes before your event), the trailer needs to be as close to the location as possible. The truck and trailer can then be moved and parked in a different location or kept where it is.</p>\r\n<p>Cathy\'s Critters arrives 30-45 minutes before your scheduled start time to set up the petting zoo. If we are needed to arrive any earlier than that, there will be an additional fee. Please cover this topic with Cathy\'s Critters when booking your event to discuss the details and fees.</p>\r\n<p>A 50% deposit is required on all events. We accept cash, personal checks, and PayPal for the deposit. Balance is due on day of event. Balance may be paid by personal check or cash. There needs to be a physical form of payment on event day.</p>\r\n<p>We reserve the right to substitute, change or not include animals for any reason. Our main concern is ALWAYS the health, comfort and safety of our animals.</p>\r\n<p>We are insured. If any person or venue requires an additional insurance policy to be purchased for an event, or needs to be added to our policy as an \"additional insured\", we need at least 48 hours (over normal business days) to process through our insurance agent. There will be a charge for additional insurance. Please cover this issue with Cathy\'s Critters well in advance of the event. A copy of insurance can be provided for each event at no cost.</p>\r\n<p>Our policy is to help you keep your party on schedule rain or shine. We will never cancel your event unilaterally for bad weather unless there are tornado warnings or severe electrical storms. We will always attempt to help you find a creative way to keep the event on track by using a covered patio or garage, changing to one of our indoor party formats, or rescheduling for a future date. If there is no covered area at your location, but you still want Cathy\'s Critters to come out in hopes that it won\'t rain at your scheduled event time, there is a charge if we get set up then have to cancel. This charge is different for each event. If none of these solutions is acceptable and you choose to cancel the event because of weather, the entire deposit will be refunded. Refund will be made contingent upon www.weather.com showing precipitation in your ZIP code during the time scheduled for your party.  If canceled by you for any other reason, the deposit is nonrefundable. </p>\r\n<p>If you are a home day care, please be aware of state regulations regarding contact between children in your charge and some animals (birds and reptiles).  If you need us to change the animal line-up for your event because of your industry\'s regulations, it is your responsibility to let us know.</p>','',1,0,0,8,'2012-09-16 23:31:01',42,'','2012-11-12 20:02:21',57,0,'0000-00-00 00:00:00','2012-09-16 23:31:01','0000-00-00 00:00:00','','','{\"show_title\":\"\",\"link_titles\":\"\",\"show_intro\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"alternative_readmore\":\"\",\"article_layout\":\"\"}',3,0,0,'','',1,133,'{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}',0,'*','');
INSERT INTO `cc1_content` VALUES (11,49,'Event Calendar','event-calendar','','<p>Please use the employee calendar as the most current indicator of your schedule.&nbsp; If anything changes at the last minute (less than a week), you will be notified by text message.</p>','',1,0,0,13,'2012-11-02 15:04:55',42,'','2013-02-16 21:24:33',42,0,'0000-00-00 00:00:00','2012-11-02 15:04:55','0000-00-00 00:00:00','','','{\"show_title\":\"\",\"link_titles\":\"\",\"show_intro\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_layout\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}',4,0,1,'','',6,1,'{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}',0,'*','');
INSERT INTO `cc1_content` VALUES (12,50,'Special services','special-services','','<p><span style=\"text-decoration: underline; font-size: xx-large; color: #000000;\">Special Events</span></p>\r\n<p>Need a cow for \"Cow Pie Bingo\"? Or a Pig for the Principal to kiss? We can provide whatever you need! Cathy\'s Critters offers a variety of special packages that can be tailored to fit the needs for your next event. Some of the events are only offered seasonally, so be sure to read each section and contact the office for further details.</p>\r\n<p> </p>\r\n<h3><span style=\"font-size: large; color: #3366ff;\">Come to the Farm!</span></h3>\r\n<p>Ever wanted to visit Cathy\'s Critters? Well now is your chance! Cathy\'s Critters is offering tours and parties at the farm as well as at Myers Park Events Center in McKinney that can be tailored to fit each event. Contact the office to book or if you need more information!</p>\r\n<p><strong><span style=\"color: #ff0000;\">Educational Farm Tours - Myers Park Event Center</span></strong></p>\r\n<p><img src=\"http://www.co.collin.tx.us/parks/photos/myers_logo_med.gif\" border=\"0\" alt=\"Myers Park logo\" width=\"147\" height=\"239\" style=\"margin-left: 10px; margin-right: 10px; float: right;\" /></p>\r\n<ul>\r\n<li>\r\n<p>State-of-the-art covered facility</p>\r\n</li>\r\n<li>\r\n<p>School bus parking</p>\r\n</li>\r\n<li>\r\n<p>Large field trips</p>\r\n</li>\r\n<li>\r\n<p>Documentation of TEKS covered</p>\r\n</li>\r\n<li>\r\n<p>Dog safety and agility demonstration</p>\r\n</li>\r\n<li>\r\n<p>Live farm animals</p>\r\n</li>\r\n<li>\r\n<p>Traditional farm skills: spinning, milking</p>\r\n</li>\r\n<li>\r\n<p>$8/child, $6/parent, $2/teacher</p>\r\n</li>\r\n</ul>\r\n<p> </p>\r\n<p> </p>\r\n<p><img src=\"images/kidsandanimals/girl_and_pig_256_cropped.jpg\" border=\"0\" alt=\"Farm visitor and &quot;Pumpkin&quot; the pig\" width=\"294\" height=\"294\" style=\"float: left; margin-left: 20px; margin-right: 20px;\" /><span style=\"color: #ff0000;\"><strong>Educational Farm Tours - Cathy\'s Critters Farm</strong><br /></span></p>\r\n<ul>\r\n<li>\r\n<p>18-acre working farm</p>\r\n</li>\r\n<li>\r\n<p>Weather-permitting</p>\r\n</li>\r\n<li>\r\n<p>Small-group field trips</p>\r\n</li>\r\n<li>\r\n<p>Documentation of TEKS covered</p>\r\n</li>\r\n<li>\r\n<p>Optional activities include goat milking, exotic animal presentation, petting zoo</p>\r\n<ul style=\"list-style-type: disc;\">\r\n<li>Picnic area</li>\r\n</ul>\r\n</li>\r\n<li>\r\n<p>Call Lisa at 972-562-0583 for pricing and activity selection</p>\r\n</li>\r\n</ul>\r\n<p> </p>\r\n<p> </p>\r\n<p> </p>\r\n<p><strong><span style=\"color: #ff0000;\">Birthday Parties on the Farm!</span></strong></p>\r\n<h4 style=\"text-align: right;\"><img src=\"images/kidsandanimals/indoor_256.jpg\" border=\"0\" alt=\"On-site activity building for parties\" style=\"float: right;\" /></h4>\r\n<ul>\r\n<li>\r\n<p>Indoor activity building</p>\r\n</li>\r\n<li>\r\n<p>Bring your decorations, cake, pizza</p>\r\n</li>\r\n<li>\r\n<p>Small freezer available for ice cream (no room to store food/drinks)</p>\r\n</li>\r\n<li>\r\n<p>Petting zoo, pony rides, or any of our exotic animal presentations</p>\r\n</li>\r\n<li>\r\n<p>Call Lisa at 972-562-0583 for scheduling and pricing</p>\r\n</li>\r\n</ul>\r\n<p> </p>\r\n<h3><span style=\"font-size: large; color: #3366ff;\">Seasonal events</span></h3>\r\n<p>These packages are offered seasonally due to the event or the animals involved. Each package can be personalized for every event. Read each package description for the information and then contact the office to book!</p>\r\n<h4><span style=\"color: #ff0000;\">                                                                                                                                </span></h4>\r\n<p><img src=\"images/nativity_256.jpg\" border=\"0\" alt=\"Donkey for Joseph\" width=\"357\" height=\"262\" style=\"float: left; margin-left: 20px; margin-right: 20px;\" /><strong><span style=\"color: #ff0000;\">Nativity Scenes</span></strong></p>\r\n<ul style=\"list-style-type: disc;\">\r\n<li>\r\n<p>Human models not included</p>\r\n<ul style=\"list-style-type: disc;\">\r\n<li>Handlers to help lead donkey, llamas, sheep, goats</li>\r\n</ul>\r\n</li>\r\n<li>\r\n<p>Rope restraints or rustic picket fence panels</p>\r\n</li>\r\n<li>\r\n<p>Couple with a petting zoo for kid-friendly fun after the caroling is done!</p>\r\n</li>\r\n<li>\r\n<p>Custom selection of number and types of livestock available to suit your program</p>\r\n<ul style=\"list-style-type: disc;\">\r\n<li>Call Lisa at 972-562-0583 for scheduling and pricing</li>\r\n</ul>\r\n</li>\r\n</ul>\r\n<p> </p>\r\n<p><strong> <span style=\"color: #ff0000;\">Goat Milking / Cheese Making Workshop</span></strong></p>\r\n<p><img src=\"images/goat_milking_256.jpg\" border=\"0\" alt=\"Make cheese with real goat\'s milk\" width=\"335\" height=\"261\" style=\"float: right;\" /></p>\r\n<ul style=\"list-style-type: disc;\">\r\n<li>\r\n<p>Unique - only program like this in the D/FW metroplex</p>\r\n</li>\r\n<li>\r\n<p>Milking stand and goats - everyone, kids and adults, learn to milk</p>\r\n</li>\r\n<li>\r\n<p>Cheese made in your kitchen from fresh goat\'s milk we bring</p>\r\n</li>\r\n<li>\r\n<p>Educational</p>\r\n</li>\r\n<li>\r\n<p>Hands-on</p>\r\n</li>\r\n<li>\r\n<p>Delicious results!</p>\r\n</li>\r\n<li>\r\n<p>Seasonal Availability</p>\r\n</li>\r\n<li>\r\n<p>Call Lisa at 972-562-0583 for scheduling and pricing</p>\r\n</li>\r\n</ul>\r\n<p> </p>\r\n<h3><span style=\"font-size: large; color: #3366ff;\">Animal Rentals</span></h3>\r\n<p>Just need one or two animals for a photo shoot or a \"Kiss the Pig\"? Cathy\'s Critters can provide them! Just let us know which type of animal you need for how long and we will give you a quote and bring the animal most suited for your event. For pricing and care, animals are categorized into groups due to the needs of each animal.</p>\r\n<h4><img src=\"images/employees/cathy.png\" border=\"0\" alt=\"Cathy and Maggie on WFAA\'s Good Morning Texas\" width=\"168\" height=\"175\" style=\"float: left; margin-left: 20px; margin-right: 20px;\" /></h4>\r\n<ul style=\"list-style-type: disc;\">\r\n<li>\r\n<p>TV/film appearances</p>\r\n</li>\r\n<li>\r\n<p>Kiss-the-pig (or llama)</p>\r\n</li>\r\n<li>\r\n<p>Exotic animals for marketing promotional photo shoots</p>\r\n</li>\r\n<li>\r\n<p>Photographers</p>\r\n</li>\r\n</ul>\r\n<p> </p>\r\n<h4> </h4>\r\n<p> </p>\r\n<h4><img src=\"images/boy_feeding_baby_wallaby_256.jpg\" border=\"0\" alt=\"Volunteer on stage to bottle-feed Sydney the wallaby\" width=\"308\" height=\"258\" style=\"float: right;\" /></h4>\r\n<ul>\r\n<li>\r\n<p>Sheep, Goats, Cattle, Pigs</p>\r\n</li>\r\n<li>\r\n<p>Reptiles</p>\r\n</li>\r\n<li>\r\n<p>Rabbits/Bunnies</p>\r\n</li>\r\n<li>\r\n<p>Chicks</p>\r\n</li>\r\n<li>\r\n<p>Kangaroo/Wallaby</p>\r\n</li>\r\n<li>\r\n<p>Hedgehog, Chinchilla</p>\r\n</li>\r\n<li>\r\n<p>Coatimundi (just ask...)</p>\r\n</li>\r\n<li>\r\n<p>Call Lisa 972-562-0583 for details and booking of animal talent</p>\r\n</li>\r\n</ul>','',1,0,0,9,'2012-11-09 01:43:44',42,'','2013-04-11 14:54:23',57,0,'0000-00-00 00:00:00','2012-11-09 01:43:44','0000-00-00 00:00:00','','','{\"show_title\":\"\",\"link_titles\":\"\",\"show_intro\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_layout\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}',30,0,10,'','',1,2365,'{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}',0,'*','');
INSERT INTO `cc1_content` VALUES (13,52,'New Arrivals','new-arrivals','','<h2><a href=\"index.php?option=com_content&amp;view=article&amp;catid=14&amp;id=13\">New Arrivals</a></h2>\r\n<p>Unlike the farm stereotype that \"Spring is the season for new life\", our place is bursting with it here in November.  Most of our goats are Nigerian Dwarf, which can breed year-round.  So we are getting a batch of adorable babies this fall, 13 so far!  We love the fact that our little ladies can bring new life to the farm twice a year. </p>\r\n<p>The other breed we raise, Nubians, only start going into heat in the fall and winter, so in the spring we will have babies *and* goats to milk!  By summer camp time, they are at their maximum production so we can lead the kids in a cheese-making activity.  On a limited basis, we can also <a href=\"index.php?option=com_content&amp;view=article&amp;catid=9&amp;id=12\">Special services</a> and give demonstrations.</p>\r\n<p><img class=\"caption\" src=\"images/animals/babies/2012-11-17 19.30.02_lowqual.jpg\" border=\"0\" alt=\"November babies born\" title=\"Shadow\'s baby\" width=\"206\" height=\"154\" /></p>','',1,0,0,14,'2012-11-21 01:52:58',42,'','2012-11-21 02:23:21',42,0,'0000-00-00 00:00:00','2012-11-21 01:52:58','0000-00-00 00:00:00','','','{\"show_title\":\"\",\"link_titles\":\"\",\"show_intro\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"alternative_readmore\":\"\",\"article_layout\":\"\"}',10,0,1,'','',1,981,'{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}',0,'*','');
INSERT INTO `cc1_content` VALUES (14,70,'Holiday Party','holiday-party-2012','','<p>The highlights of Cathy\'s Critters holiday party on the farm were:</p>\r\n<p>&nbsp;- The presentation of embroidered sweatshirts to senior team members</p>\r\n<p>&nbsp;- Lizzie\'s fabulous jambalaya</p>\r\n<p>&nbsp;- The musical stylings of Cap Hopkins on violin, accompanied by Kris Fournier and Kevin Smith on guitar</p>\r\n<p>&nbsp;- The hip-hop dance lesson from our very own Ty Hopper...</p>\r\n<p><a href=\"http://www.youtube.com/watch?v=PrSg6-2hyhI\" title=\"Dance-master Ty does &quot;The Wobble&quot;\">http://www.youtube.com/watch?v=PrSg6-2hyhI</a></p>\r\n<p>&nbsp;\r\n<object width=\"640\" height=\"240\" classid=\"clsid:02bf25d5-8c17-4b23-bc80-d3488abddc6b\"><param name=\"src\" value=\"media/video/Wobble.mov\" /><param name=\"kioskmode\" value=\"true\" /><param name=\"scale\" value=\"tofit\" /><embed width=\"640\" height=\"240\" type=\"video/quicktime\" src=\"media/video/Wobble.mov\" kioskmode=\"true\" scale=\"tofit\" class=\"mceItemMedia mceItemQuickTime\"></embed></object>\r\n</p>\r\n<p>Thanks, Ty!</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>','',1,0,0,13,'2012-12-20 23:12:20',42,'','2013-02-16 21:21:45',42,0,'0000-00-00 00:00:00','2012-12-20 23:12:20','0000-00-00 00:00:00','','','{\"show_title\":\"\",\"link_titles\":\"\",\"show_intro\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_layout\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}',23,0,0,'','',6,136,'{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}',0,'*','');
INSERT INTO `cc1_content` VALUES (15,71,'What We Do','services','','<p> </p>\r\n<div class=\"art-postcontent\">\r\n<h2><span style=\"color: #ff0000;\">Special event announcement:</span></h2>\r\n<h2><a href=\"index.php/services/open-farm-event\">Click here for information about our Open Farm event on June 22.  Open to the public!</a></h2>\r\n<h1>We bring the Farm to you (or, you to the farm)</h1>\r\nClick on a link for more details about our services, or just Book an Event now!<br />\r\n<div> </div>\r\n<div>\r\n<table style=\"width: 664px; height: 753px;\" border=\"0\">\r\n<tbody>\r\n<tr>\r\n<td>\r\n<h2><a href=\"index.php/services/petting-zoos\">Petting Zoos</a> /</h2>\r\n<h2><a href=\"index.php/services/pony-rides\">Pony Rides</a></h2>\r\n<p><img src=\"images/kidsandanimals/happy_girl_and_goat_256_cropped.jpg\" border=\"0\" alt=\"Girl feeding goat\" width=\"324\" height=\"324\" style=\"vertical-align: top;\" /></p>\r\n</td>\r\n<td>\r\n<h2><a href=\"index.php/services/indoor-presentations\">Educational Assemblies</a> /</h2>\r\n<h2><a href=\"index.php/services/indoor-presentations\"> Indoor Playgroups</a></h2>\r\n<p><img src=\"images/kidsandanimals/cathyonsafari_256_cropped.jpg\" border=\"0\" alt=\"Cathy on a WorldWide Safari\" title=\"Safari Guide, Cathy Smith\" width=\"324\" height=\"324\" style=\"vertical-align: top;\" /></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<h2><a href=\"index.php/services/critter-camp\">Critter Camp</a></h2>\r\n<p><img src=\"images/crittercamp/goat_milking_256_cropped.jpg\" border=\"0\" alt=\"Goat Milking at Critter Camp\" width=\"324\" height=\"324\" /></p>\r\n</td>\r\n<td>\r\n<h2 style=\"text-align: left;\"><a href=\"index.php/services/special-services\">Farm Visits</a></h2>\r\n<p><img src=\"images/kidsandanimals/girl_and_pig_256_cropped.jpg\" border=\"0\" alt=\"Visit with animals and play outside\" width=\"324\" height=\"324\" /></p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n<div>\r\n<p>Cathy’s Critters is in the business of providing quality experiences with animals for kids, parents, and the community.  Our belief is that one-on-one contact with animals, including coaching in care, feeding and being gentle, helps children develop a sense of empathy and connectedness with their world.</p>\r\n<p>Everything we do is presented by our team of animals and dedicated employees.  Please enjoy the rest of the site and don’t forget to sign up for our occasionally-published newsletter and follow us on Twitter and Facebook!</p>\r\n</div>\r\n</div>','',1,0,0,10,'2011-12-22 04:49:16',42,'','2013-05-14 15:51:12',42,0,'0000-00-00 00:00:00','2011-12-22 04:49:16','0000-00-00 00:00:00','','','{\"show_title\":\"\",\"link_titles\":\"\",\"show_intro\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_layout\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}',37,0,0,'','',1,30559,'{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}',0,'*','');
INSERT INTO `cc1_content` VALUES (16,72,'Please Log In','please-log-in','','<h1>Please log in or create account in the sidebar, to the left</h1>\r\n<p><img alt=\"chinchillas at work\" src=\"images/chinchillas_at_work.jpeg\" height=\"384\" width=\"512\" /></p>','',1,0,0,2,'2013-01-01 01:32:35',42,'','2013-02-16 21:01:23',42,0,'0000-00-00 00:00:00','2013-01-01 01:32:35','0000-00-00 00:00:00','','','{\"show_title\":\"\",\"link_titles\":\"\",\"show_intro\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_layout\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}',3,0,2,'','',1,696,'{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}',0,'*','');
INSERT INTO `cc1_content` VALUES (17,73,'Photo Souvenirs','photo-souvenirs','','<h2>Photo Souvenirs</h2>\r\n<p>We also offer \"Photo Souvenirs\" at any private event (for an additional fee). A photographer will come to your event and take a picture of each of your guests with their favorite animal. The picture will be printed at the event and put into 4x6 photo folders for giving out as party favors. If you would like to add Photo Souvenirs to your event, just select it when you fill out the contract!</p>\r\n<p><img src=\"images/photo%20souvenir%20example4.jpg\" border=\"0\" alt=\"Photo souvenirs can be made at any event\" width=\"311\" height=\"396\" /></p>','',1,0,0,9,'2013-01-01 01:56:54',42,'','2013-01-01 02:09:36',42,0,'0000-00-00 00:00:00','2013-01-01 01:56:54','0000-00-00 00:00:00','','','{\"show_title\":\"\",\"link_titles\":\"\",\"show_intro\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_layout\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}',4,0,5,'','',1,253,'{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}',0,'*','');
INSERT INTO `cc1_content` VALUES (18,74,'Hiring for Spring','hiring-for-spring','','<h2><a href=\"index.php?option=com_content&amp;view=article&amp;catid=14&amp;id=13\">Now Hiring</a></h2>\r\n<p>Cathy\'s Critters is getting ready to staff up for the busy Spring season!  We are a seasonal business and the spring festival season starts in March, so we hire petting zoo attendants for the 2-month period of March-April.  We also think of it as a \"trial period\" for potential permanent employees, so please contact us if you are at least 16 years of age (or close), have reliable transportation to the farm, and would love an opportunity to help us spread the joy of animal communion.</p>\r\n<p><a href=\"images/employees/dscn6956.jpg\"><img class=\"caption\" src=\"images/employees/dscn6956.jpg\" border=\"0\" alt=\"November babies born\" title=\"Shadow\'s baby\" width=\"206\" height=\"154\" /></a></p>','',1,0,0,14,'2012-11-21 01:52:58',42,'','2013-01-01 02:42:26',42,0,'0000-00-00 00:00:00','2012-11-21 01:52:58','0000-00-00 00:00:00','','','{\"show_title\":\"\",\"link_titles\":\"\",\"show_intro\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_layout\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}',2,0,0,'','',1,15,'{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}',0,'*','');
INSERT INTO `cc1_content` VALUES (19,78,'Sub-Logo','sub-logo','','<p>Cathy\'s Critters</p>\r\n<p>Give critters a chance (TM)</p>','',1,0,0,2,'2013-01-20 21:16:07',42,'','2013-01-20 21:17:08',42,0,'0000-00-00 00:00:00','2013-01-20 21:16:07','0000-00-00 00:00:00','','','{\"show_title\":\"\",\"link_titles\":\"\",\"show_intro\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_layout\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}',2,0,1,'','',1,5,'{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}',0,'*','');
INSERT INTO `cc1_content` VALUES (20,79,'Why choose our petting zoo','selling-points','','<h1>Heading 1</h1>\r\n<h2>Heading 2</h2>\r\n<h3>Heading 3</h3>\r\n<h4>Heading 4</h4>\r\n<p> </p>\r\n<p>A petting zoo is always one of the best-attended and best-loved attractions at any event.  Kids and parents alike get to spend time petting, cuddling, and feeding animals they don\'t get to see every day.  We bring the critters, portable fences, cups, feed, sanitizer, and knowledgeable attendants to make your event memorable.</p>\r\n<p>Our animals are always clean and well-behaved.  They get lots of attention and handling and so are naturally tame and gentle. Our attendants are the same.  We hire people with a passion for teaching kids about animals through gentle coaching and encouragement.</p>\r\n<p>We are an on-time machine, spending as much time on office organization and planning as we spend in the petting zoos themselves.  We have an office manager dedicated to making sure your team arrives on time and prepared to make your party memorable for all your guests.  Our farm hand employees make sure the equipment is well-maintained and the trailers are properly stocked for your events.  At Cathy\'s Critters, we don\'t believe in cutting corners, and it shows in our presentation.  We can set up on grass or concrete, and our fence panels are portable and quick to set up, ensuring that we are ready on time and packed up, cleaned up and out of your way quickly after the event.</p>','',0,0,0,9,'2013-01-20 22:07:28',42,'','0000-00-00 00:00:00',0,0,'0000-00-00 00:00:00','0000-00-00 00:00:00','0000-00-00 00:00:00','','','{\"show_title\":\"\",\"link_titles\":\"\",\"show_intro\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_layout\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}',1,0,4,'','',1,0,'{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}',0,'*','');
