INSERT INTO `cc1_content` VALUES (22,111,'Field Trips','field-trips','','<h2>Class Field Trips  -  <a href=\"index.php/news/field-trip-open-house\">View Open House Flyer</a></h2>\r\n<p>Our premium field trip for large school groups with plenty of bus parking, restrooms, and an all-weather venue is the visit we host at Myers Park And Event Center.  A different on-farm experience is available for small- to medium-sized groups at Cathy\'s Critters headquarters in Princeton, Texas.</p>\r\n<p> </p>\r\n<h4 style=\"text-align: right;\">Myers Park &amp; Event Center</h4>\r\n<p><img src=\"http://www.co.collin.tx.us/parks/photos/myers_logo_med.gif\" border=\"0\" alt=\"Myers Park logo\" width=\"147\" height=\"239\" style=\"margin-left: 10px; margin-right: 10px; float: right;\" /></p>\r\n<ul>\r\n<li>\r\n<p>State-of-the-art covered facility</p>\r\n</li>\r\n<li>\r\n<p>School bus parking</p>\r\n</li>\r\n<li>\r\n<p>Large field trips</p>\r\n</li>\r\n<li>\r\n<p>Documentation of TEKS covered</p>\r\n</li>\r\n<li>\r\n<p>Dog safety and agility demonstration</p>\r\n</li>\r\n<li>\r\n<p>Live farm animals</p>\r\n</li>\r\n<li>\r\n<p>Traditional farm skills: spinning, milking</p>\r\n</li>\r\n<li>\r\n<p>$8/child, $6/parent, $2/teacher</p>\r\n</li>\r\n</ul>\r\n<p> </p>\r\n<p> </p>\r\n<h4 style=\"text-align: left;\">Visit Cathy\'s Critters\' Farm</h4>\r\n<p><img src=\"images/kidsandanimals/girl_and_pig_256_cropped.jpg\" border=\"0\" alt=\"Farm visitor and &quot;Pumpkin&quot; the pig\" width=\"332\" height=\"332\" style=\"float: left; margin-left: 20px; margin-right: 20px;\" /></p>\r\n<h4 style=\"text-align: left;\"> </h4>\r\n<ul>\r\n<li>\r\n<p>18-acre working farm</p>\r\n</li>\r\n</ul>\r\n<ul>\r\n<li>\r\n<p>Weather-permitting</p>\r\n</li>\r\n<li>\r\n<p>Small-group field trips</p>\r\n</li>\r\n<li>\r\n<p>Documentation of TEKS covered</p>\r\n</li>\r\n<li>\r\n<p>Goat-milking</p>\r\n</li>\r\n<li>\r\n<p>Exotic animal demos</p>\r\n</li>\r\n<li>\r\n<p>Hands-on petting zoos</p>\r\n</li>\r\n<li>\r\n<p>Picnic area</p>\r\n</li>\r\n<li>\r\n<p>Call Lisa at 972-562-0583 for pricing and activity selection</p>\r\n</li>\r\n</ul>','',1,0,0,9,'2012-11-09 01:43:44',42,'','2013-02-26 17:10:38',42,0,'0000-00-00 00:00:00','2012-11-09 01:43:44','0000-00-00 00:00:00','','','{\"show_title\":\"\",\"link_titles\":\"\",\"show_intro\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_layout\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}',8,0,3,'','',1,385,'{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}',0,'*','');
INSERT INTO `cc1_content` VALUES (23,114,'Field Trip Open House','field-trip-open-house','','<p style=\"text-align: center;\"><strong><span style=\"font-family: comic sans ms,sans-serif; font-size: x-large; color: #339966;\">Open House!</span></strong></p>\r\n<p style=\"text-align: center;\"> </p>\r\n<hr width=\"600\" size=\"3\" style=\"height: 3px; width: 600px;\" />\r\n<p style=\"text-align: center;\"><strong><span style=\"font-family: comic sans ms,sans-serif; font-size: x-large; color: #339966;\"> </span></strong></p>\r\n<p><strong><span style=\"font-family: comic sans ms,sans-serif; font-size: x-large; color: #339966;\"><img src=\"images/logo/Cathys-Critters_Logo1_Final_72.png\" border=\"0\" width=\"159\" height=\"79\" style=\"float: left; margin-left: 5px; margin-right: 5px;\" />    Partners with...</span></strong><strong><span style=\"font-family: comic sans ms,sans-serif; font-size: x-large; color: #339966;\"><img src=\"images/myers_logo_med.gif\" border=\"0\" alt=\"Myers Park logo\" width=\"99\" height=\"160\" style=\"margin-left: 10px; margin-right: 10px; float: right;\" /></span></strong></p>\r\n<p><strong><span style=\"font-family: comic sans ms,sans-serif; font-size: x-large; color: #339966;\"> </span></strong></p>\r\n<p><strong><span style=\"font-family: comic sans ms,sans-serif; font-size: x-large; color: #339966;\"> </span></strong></p>\r\n<p><strong><span style=\"font-family: comic sans ms,sans-serif; font-size: x-large; color: #339966;\"> </span></strong></p>\r\n<p><strong><span style=\"font-family: comic sans ms,sans-serif; font-size: x-large; color: #339966;\">for a NEW field trip opportunity:   </span></strong></p>\r\n<p><strong><span style=\"font-family: comic sans ms,sans-serif; font-size: x-large; color: #339966;\"> </span></strong></p>\r\n<p style=\"text-align: center;\"><strong><span style=\"font-family: comic sans ms,sans-serif; font-size: x-large; color: #339966;\">\"Schoolhouse Farm and Fun\"<br /></span></strong></p>\r\n<p><strong><span style=\"font-family: comic sans ms,sans-serif; font-size: x-large; color: #339966;\"> </span></strong></p>\r\n<div class=\"Section1\">\r\n<p class=\"MsoNormal\"><span style=\"font-size: 16.0pt; mso-bidi-font-size: 12.0pt;\">When:</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: center;\" align=\"center\"><span style=\"font-size: 16.0pt; mso-bidi-font-size: 12.0pt; color: #c0504d;\">Tuesday, March 19, 2013</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: center;\" align=\"center\"><span style=\"font-size: 16.0pt; mso-bidi-font-size: 12.0pt; color: #c0504d;\">6:00 – 8:00 pm</span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size: 16.0pt; mso-bidi-font-size: 12.0pt;\">Who:</span></p>\r\n<p class=\"MsoNormal\" style=\"text-indent: .5in;\"><span style=\"font-size: 16.0pt; mso-bidi-font-size: 12.0pt; color: green;\">Kindergarten and 1<sup>st</sup> grade Teachers, public and private</span></p>\r\n<p class=\"MsoNormal\" style=\"text-indent: .5in;\"><span style=\"font-size: 16.0pt; mso-bidi-font-size: 12.0pt; color: green;\">Boy/Girl Scout Leaders</span></p>\r\n<p class=\"MsoNormal\" style=\"text-indent: .5in;\"><span style=\"font-size: 16.0pt; mso-bidi-font-size: 12.0pt; color: green;\">Homeschool Educators</span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size: 16.0pt; mso-bidi-font-size: 12.0pt;\"> </span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size: 16.0pt; mso-bidi-font-size: 12.0pt;\">Where:</span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size: 16.0pt; mso-bidi-font-size: 12.0pt;\"><span style=\"mso-tab-count: 1;\">         </span><span style=\"color: green;\">Myers Park and Events Center</span></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size: 16.0pt; mso-bidi-font-size: 12.0pt; color: green;\"><span style=\"mso-tab-count: 1;\">         </span>7117 CR 166, McKinney TX (just north on Lake Forest)</span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size: 16.0pt; mso-bidi-font-size: 12.0pt;\"> </span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size: 16.0pt; mso-bidi-font-size: 12.0pt;\">Details:</span></p>\r\n<p class=\"MsoNormal\" style=\"text-indent: .5in;\"><span style=\"font-size: 16.0pt; mso-bidi-font-size: 12.0pt; color: green;\">“<span style=\"font-family: comic sans ms,sans-serif;\">School House Farm &amp; Friends</span>” hosted at Myers Park by <br /></span></p>\r\n<p class=\"MsoNormal\" style=\"text-indent: .5in;\"><span style=\"font-size: 16.0pt; mso-bidi-font-size: 12.0pt; color: green;\">       The Farm Museum, Cathy\'s Critters and Fun On The Farm<br /></span></p>\r\n<p class=\"MsoNormal\" style=\"text-indent: .5in;\"><span style=\"font-size: 16.0pt; mso-bidi-font-size: 12.0pt; color: green;\">Preview our two-hour field trip on farm education </span></p>\r\n<p class=\"MsoNormal\" style=\"text-indent: .5in;\"><span style=\"font-size: 16.0pt; mso-bidi-font-size: 12.0pt; color: green;\">Covers 19 K-1 TEKS</span></p>\r\n<p class=\"MsoNormal\" style=\"text-indent: .5in;\"><span style=\"font-size: 16.0pt; mso-bidi-font-size: 12.0pt; color: green;\">Farm animals and dog agility demonstration</span></p>\r\n<p class=\"MsoNormal\" style=\"text-indent: .5in;\"><span style=\"font-size: 16.0pt; mso-bidi-font-size: 12.0pt; color: green;\">Fun facts (among others):</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-left: .5in; text-indent: .5in;\"><span style=\"font-size: 16.0pt; mso-bidi-font-size: 12.0pt; color: green;\">Where does milk come from?<span style=\"mso-tab-count: 1;\"><br /></span></span></p>\r\n<p class=\"MsoNormal\" style=\"margin-left: .5in; text-indent: .5in;\"><span style=\"font-size: 16.0pt; mso-bidi-font-size: 12.0pt; color: green;\">What do goats\' teeth look like?<span style=\"mso-tab-count: 1;\"><br /></span></span></p>\r\n<p class=\"MsoNormal\" style=\"margin-left: .5in; text-indent: .5in;\"><span style=\"font-size: 16.0pt; mso-bidi-font-size: 12.0pt; color: green;\">How does a sheep make a sweater?<span style=\"mso-tab-count: 1;\"><br /></span></span></p>\r\n<p class=\"MsoNormal\" style=\"margin-left: .5in; text-indent: .5in;\"><span style=\"font-size: 16.0pt; mso-bidi-font-size: 12.0pt; color: green;\">How does one farmer grow so many plants?<span style=\"mso-tab-count: 1;\"><br /></span></span></p>\r\n<p class=\"MsoNormal\" style=\"text-indent: .5in;\"><span style=\"font-size: 16.0pt; mso-bidi-font-size: 12.0pt; color: green;\">Meet the critters: goats, llama, horse, ducks, and more!</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: center;\"><span style=\"font-size: medium; color: #ff0000;\">Call or email to RSVP or for more details:</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: center;\"><span style=\"font-size: medium; color: #ff0000;\">Lisa Cass, 972-562-0583</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: center;\"><span style=\"font-size: medium; color: #ff0000;\">info@cathys-critters.com</span></p>\r\n</div>','',1,0,0,14,'2013-02-26 16:53:23',42,'','2013-02-26 20:20:47',42,0,'0000-00-00 00:00:00','2013-02-26 16:53:23','0000-00-00 00:00:00','','','{\"show_title\":\"\",\"link_titles\":\"\",\"show_intro\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_layout\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}',20,0,0,'','',1,174,'{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}',0,'*','');
