INSERT INTO `cc1_content` VALUES (25,116,'Field Trips To The Farm','field-trips-cathys-critters-farm','','<h4 style=\"text-align: left;\">Visit Cathy\'s Critters\' Farm</h4>\r\n<p><img src=\"images/kidsandanimals/girl_and_pig_256_cropped.jpg\" border=\"0\" alt=\"Farm visitor and &quot;Pumpkin&quot; the pig\" width=\"313\" height=\"313\" style=\"float: left; margin-left: 20px; margin-right: 20px;\" /></p>\r\n<ul>\r\n<li>\r\n<p>18-acre working farm</p>\r\n</li>\r\n</ul>\r\n<ul>\r\n<li>\r\n<p>Weather-permitting</p>\r\n</li>\r\n<li>\r\n<p>Small-group field trips (limited school bus parking)</p>\r\n</li>\r\n<li>\r\n<p>Documentation of TEKS covered</p>\r\n</li>\r\n<li>\r\n<p>Goat-milking</p>\r\n</li>\r\n<li>\r\n<p>Exotic animal demos</p>\r\n</li>\r\n<li>\r\n<p>Hands-on petting zoos</p>\r\n</li>\r\n<li>\r\n<p>Picnic area</p>\r\n</li>\r\n<li>\r\n<p>Call Lisa at 972-562-0583 for pricing and activity selection</p>\r\n</li>\r\n</ul>','',1,0,0,9,'2012-11-09 01:43:44',42,'','2013-02-28 22:48:38',42,0,'0000-00-00 00:00:00','2012-11-09 01:43:44','0000-00-00 00:00:00','','','{\"show_title\":\"\",\"link_titles\":\"\",\"show_intro\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_layout\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}',4,0,1,'','',1,221,'{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}',0,'*','');
INSERT INTO `cc1_content` VALUES (26,126,'June 22 Open House','open-house-2013-06-22','','<h2>Open Farm Events</h2>\r\n<p>Our very FIRST Open Farm Day will be on June 22 from 10 am - 4 pm. We here at Cathy\'s Critters are so excited to open the farm to the public for the first time! Bring the whole family and all your friends for a day of farm fun and animal adventures. We\'ll have Critter Camp preview activities, tours, and a chance to interact \"up close and personal\" with animals that you can only see from a distance at the zoo - like a Kangaroo!</p>\r\n<p>Cathy\'s Critters will also be serving food and drinks and some of the activities included for the day will be a petting zoo, pony rides, goat milking and more! The fee is $8 per adult and $5 per child 3 years and older. So saddle up the family car and head to the country for a great day at Cathy\'s Critters\' farm (located at 7422 County Road 466, Princeton, Tx 75407).</p>\r\n<p> </p>\r\n<h3>Open Farm Day - June 22nd</h3>\r\n<p>A few of the activities we are planning are listed below, but the schedule of events or activities might change.  Watch this space for updates! You can also call and email with any questions.</p>\r\n<h4>Food</h4>\r\n<p>Special guest Cash Foley will be smoking barbecue and grilling burgers.  The full menu will be posted in this space as we get closer to the event.</p>\r\n<h4>Educational Exotic Animal Interactions<img src=\"images/kidsandanimals/idy256.jpg\" border=\"0\" alt=\"\" width=\"107\" height=\"172\" align=\"right\" /></h4>\r\n<p>Throughout the day, our activity building will house reptiles and other exotic animals (mammals and birds) for your viewing pleasure. One of our animal educators will be presenting the exotic animals and will put on LIVE reptile feedings at 11 am, 1 pm and 2:30 pm. Guests are allowed to come and go to see, hold and pet the exotic animals between feedings.</p>\r\n<h4> </h4>\r\n<h4>Hop with a Kangaroo!</h4>\r\n<p><img src=\"images/Kangaroo.JPG\" border=\"0\" alt=\"\" width=\"182\" height=\"120\" align=\"left\" /></p>\r\n<p> </p>\r\n<p>Cathy Smith, owner and operator of Cathy\'s Critters, will be your Kangaroo tour guide for the day! She will be available at all times to take guests into \"The Outback\" where our Kangaroos live. There are also a few other animals that live with the Kangaroos in \"The Outback\" such as an emu, baby goats and sheep. Animal food will be provided for the kangaroos and farm animals.</p>\r\n<h4> </h4>\r\n<h4>Petting Zoo and Pony Rides<img src=\"images/PettingZoo.jpg\" border=\"0\" alt=\"\" width=\"189\" height=\"125\" style=\"float: right;\" /></h4>\r\n<p>Throughout the day, a petting zoo and pony rides will be available for hands-on interaction with goats, pigs, rabbits and more. So be sure to stop by and hold a rabbit or feed a goat!</p>\r\n<p> </p>\r\n<h4>Hay Ride Farm Tour</h4>\r\n<h4><img src=\"images/DSC01664.JPG\" border=\"0\" alt=\"\" width=\"200\" height=\"137\" align=\"left\" /></h4>\r\n<p> Cathy\'s Critters is situated on 18 acres and is home to hundreds of animals.  A hayride tour will be offered to our guests to see all the animals\' living quarters and learn about what it takes to maintain their homes.  Tours are about 30 minutes each and begin at 10:30, 12:30, and 3:00.</p>\r\n<h4> </h4>\r\n<h4> </h4>\r\n<h4>Goat Milking Demonstration<img src=\"images/goat_milking_256.jpg\" border=\"0\" alt=\"\" width=\"161\" height=\"125\" style=\"float: right;\" /></h4>\r\n<p>Have you ever milked a goat? Want to? Come visit Cathy\'s Critters on June 22nd! We will put on a demonstration of how to milk the goats, what we use the milk for and even let your kids try their hands at milking a goat.</p>\r\n<p> </p>','',1,0,0,9,'2012-11-09 01:43:44',42,'','2013-05-15 19:08:33',57,0,'0000-00-00 00:00:00','2012-11-09 01:43:44','0000-00-00 00:00:00','','','{\"show_title\":\"\",\"link_titles\":\"\",\"show_intro\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_layout\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}',9,0,0,'','',1,50,'{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}',0,'*','');
