INSERT INTO `cc1_fabrik_jsactions` VALUES (188,143,'load','var url = \'index.php?option=com_fabrik&format=raw&task=plugin.userAjax&method=fetchUserProfile\';\r\n\r\nvar user_id = this.getValue();\r\n\r\nvar update_first_name = $(\'cc1_critters_reservations___user_first_name\');\r\nvar update_last_name = $(\'cc1_critters_reservations___user_last_name\');\r\nvar update_address1 = $(\'cc1_critters_reservations___user_address1\');\r\nvar update_address2 = $(\'cc1_critters_reservations___user_address2\');\r\nvar update_city = $(\'cc1_critters_reservations___user_city\');\r\nvar update_state = $(\'cc1_critters_reservations___user_state\');\r\nvar update_zip = $(\'cc1_critters_reservations___user_zip\');\r\nvar update_phone1 = $(\'cc1_critters_reservations___user_phone1\');\r\nvar update_phone2 = $(\'cc1_critters_reservations___user_phone2\');\r\n\r\n\r\nnew Request({\r\n   url:url,\r\n   data: {\'user_id\' : user_id}\n\r\n\r\n,\r\n      onComplete:function(r){\r\n         var profile_array = JSON.parse(r);\r\n         update_first_name.value = profile_array.user_first_name;\r\n         update_last_name.value = profile_array.user_last_name;\r\n         update_address1.value = profile_array.user_address1;\r\n         update_address2.value = profile_array.user_address2;\r\n         update_city.value = profile_array.user_city;\r\n         update_state.value = profile_array.user_state;\r\n         update_zip.value = profile_array.user_zip;\r\n         update_phone1.value = profile_array.user_phone1;\r\n         update_phone2.value = profile_array.user_phone2;\r\n      }\n\r\n\r\n\r\n\r\n\r\n   }\n\r\n\r\n\r\n\r\n\r\n).send();\r\n','{\"js_e_event\":\"\",\"js_e_trigger\":\"\",\"js_e_condition\":\"\",\"js_e_value\":\"\"}');
