INSERT INTO `cc1_it_emails` VALUES (5,'user_new','User - Issue Creation Message','Issue [issue_id] Created','<p>Thank you for submitting your issue.</p>\r\n<p>You can view or update [requires login] the issue at: [url]</p>\r\n<p><span style=\"text-decoration: underline;\"> </span></p>\r\n<p><span style=\"text-decoration: underline;\">ISSUE DETAILS</span></p>\r\n<p>ID: [issue_id]</p>\r\n<p>User: [user_name]</p>\r\n<p>Date: [startdate]</p>\r\n<p>Title: [title]</p>\r\n<p> </p>\r\n<p><span style=\"text-decoration: underline;\">DESCRIPTION</span></p>\r\n<p>[description]</p>',0,1,0,'0000-00-00 00:00:00','0000-00-00 00:00:00','','2013-02-05 20:34:07','headcritter1');
INSERT INTO `cc1_it_emails` VALUES (6,'user_update','User - Issue Update Message','Your Issue [issue_id] Updated','<p>Your raised issue has been updated.</p>\n<p>You can view the issue at: [url]</p>\n<p><span style=\"text-decoration: underline;\">ISSUE DETAILS</span></p>\n<p>ID: [issue_id]</p>\n<p>User: [user_name]</p>\n<p>Date: [startdate]</p>\n<p>Title: [title]</p>\n<p>&nbsp;</p>\n<p><span style=\"text-decoration: underline;\">DESCRIPTION</span></p>\n<p>[description]</p>\n<p>&nbsp;</p>\n<p><span style=\"text-decoration: underline;\">PROGRESS </span></p>\n<p>[progress]</p>',0,1,0,'0000-00-00 00:00:00','0000-00-00 00:00:00','',NULL,NULL);
INSERT INTO `cc1_it_emails` VALUES (7,'admin_new','Admin - New Issue Message','Issue [issue_id] Created','<p>The following issue has been created and the assignment may need checking.</p>\n<p>You can update the issue at [url]</p>\n<p><span style=\"text-decoration: underline;\">ISSUE DETAILS </span></p>\n<p>ID: [issue_id]</p>\n<p>Date: [startdate]</p>\n<p>Title: [title]</p>\n<p>Priority: [priority]</p>\n<p>Project: [project]</p>\n<p>&nbsp;</p>\n<p><span style=\"text-decoration: underline;\">USER INFORMATION </span></p>\n<p>Fullname: [user_fullname]</p>\n<p>Username: [user_name]</p>\n<p>Email: [user_email]</p>\n<p>&nbsp;</p>\n<p><span style=\"text-decoration: underline;\">DESCRIPTION</span></p>\n<p>[description]</p>',0,1,0,'0000-00-00 00:00:00','0000-00-00 00:00:00','',NULL,NULL);
INSERT INTO `cc1_it_emails` VALUES (8,'admin_update','Admin - Issue Updated Message','Issue [issue_id] Updated','<p>The following issue has been updated. You can view the issue at [url]</p>\n<p><span style=\"text-decoration: underline;\">ISSUE DETAILS</span></p>\n<p>ID: [issue_id]</p>\n<p>Date: [startdate]</p>\n<p>Title: [title]</p>\n<p>Priority: [priority]</p>\n<p>Project: [project]</p>\n<p>Status: [status]</p>\n<p>&nbsp;</p>\n<p><span style=\"text-decoration: underline;\">USER INFORMATION</span></p>\n<p>Fullname: [user_fullname]</p>\n<p>Username: [user_name]</p>\n<p>Email: [user_email]</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p><span style=\"text-decoration: underline;\">DESCRIPTION</span></p>\n<p>[description]</p>',0,1,0,'0000-00-00 00:00:00','0000-00-00 00:00:00','',NULL,NULL);
INSERT INTO `cc1_it_emails` VALUES (9,'admin_close','Admin - Issue closure','Issue [issue_id] closed','<p>The following issue has been closed.</p>\n<p>You can view the issue at [url]</p>\n<p><span style=\"text-decoration: underline;\">&nbsp;</span></p>\n<p><span style=\"text-decoration: underline;\">ISSUE DETAILS</span></p>\n<p>ID: [issue_id]</p>\n<p>User: [user_name]</p>\n<p>Date: [startdate]</p>\n<p>Title: [title]</p>\n<p>Priority: [priority]</p>\n<p>Project: [project]</p>\n<p><span style=\"text-decoration: underline;\">&nbsp;</span></p>\n<p><span style=\"text-decoration: underline;\">RESOLUTION</span></p>\n<p>[resolution]</p>',1,1,0,'0000-00-00 00:00:00','0000-00-00 00:00:00','',NULL,NULL);
INSERT INTO `cc1_it_issues` VALUES (31,79,'AEZMLDCTKU','Party time format change','<p>Would like to see forms display party time as:</p>\r\n<p>Start: 2:30 PM</p>\r\n<p>End: 4:00 PM</p>\r\n<p><br />Instead of</p>\r\n<p>Start: 2:30 PM 1.5 hours</p>',31,'2013-01-26 11:21:18',10,42,2,1,1,1,0,'0000-00-00 00:00:00',1,1,'2013-01-31 06:00:00','<p>Fixed!</p>','0000-00-00 00:00:00','<p>Used strtodate($start_time . \"+ $duration hours\")</p>','2013-01-26 17:23:58','headcritter1','2013-02-07 15:50:20','headcritter1');
INSERT INTO `cc1_it_issues` VALUES (32,80,'AIYG8DRNU5','Organization Contract - Time display format.','<p>On the top right section of the contract, the time should state \"1:00 pm - 2:30 pm\" instead of \"1:00 pm for 1.5 hours\"</p>',31,'2013-01-28 11:17:27',10,42,2,1,1,1,0,'0000-00-00 00:00:00',2,2,'2013-03-05 06:00:00','<p>Fixed.</p>','0000-00-00 00:00:00','','2013-01-28 17:26:51','headcritter3','2013-02-07 15:51:02','headcritter1');
INSERT INTO `cc1_it_issues` VALUES (33,81,'AS218FO6OY','Organization Contract - Missing $ sign','<p>On top right side of contract, price line should state \"Little Rancher petting zoo for 1 hour at $290\" -- this line is always missing the $ sign.</p>',31,'2013-01-28 11:27:27',10,42,2,1,1,1,0,'0000-00-00 00:00:00',3,2,'2013-03-05 06:00:00','<p>Fixed.</p>','0000-00-00 00:00:00','','2013-01-28 17:29:55','headcritter3','2013-02-07 15:49:47','headcritter3');
INSERT INTO `cc1_it_issues` VALUES (34,82,'AE37QGXQCY','Organization Contract - Mileage fee display','<p>On top right of contract, Travel fee line currently states \"Travel fee ($2/mile, outside a 40-mile radius): $130.</p>\r\n<p>Firstly, I think we should delete the entire \"($2/mile ...)\" section. Not sure the customers really need to know that.</p>\r\n<p>Secondly, is it outside of a 40 or 50 mile radius?</p>\r\n<p>Thirdly, decide on the actual fee. Mileage now is $2/mile - LC and Cathy think it should be $1.5/ mile.</p>\r\n<p>Lastly, I\'m not sure the fee is calculating correctly. For example, the zip code to this particular $130 fee calculates to $122. Another contract was supposed to calculate to $170 but came up as $156.</p>',39,'2013-01-28 11:53:52',10,42,1,1,1,1,0,'0000-00-00 00:00:00',4,3,'2013-03-05 06:00:00','<p>Fixed, with comments.</p>\r\n<p><br />I think a 40 mile radius is appropriate unless we\'re getting a lot of travel fees applied to customers you don\'t think are a pain in the ass to get to :-)</p>\r\n<p>I don\'t think it\'s bad to have the formula displayed to the customer in the name of transparency.</p>\r\n<p>--</p>\r\n<p> </p>\r\n<p>Are you OK with the current mileage verbiage on the contract?  Please let me know if you get this message so I know this is an effective way to communicate back and forth about issues in Issue Tracker.</p>\r\n<p>--</p>','0000-00-00 00:00:00','','2013-01-28 17:54:21','headcritter3','2013-02-13 01:44:43','headcritter1');
INSERT INTO `cc1_it_issues` VALUES (35,83,'AXAZ7VZAI6','Organization Contract - Main title text','<p>On top center title line, should state \"Cathy\'s Critters - Organization Event Contract\" instead of \"Cathy\'s Critters - Event Contract\"</p>',39,'2013-01-28 11:54:21',10,42,2,1,1,1,0,'0000-00-00 00:00:00',5,2,'2013-03-05 06:00:00','<p>To confirm - still want this change?</p>\r\n<p>--</p>\r\n<p>Please respond - are we OK on this?  Or do you want me to change it?</p>','0000-00-00 00:00:00','<p>Can we not do this one?  As long as the private contract says \"Private\" doesn\'t that distinguish them well enough?</p>','2013-01-28 17:55:09','headcritter3','2013-02-13 01:51:29','headcritter1');
INSERT INTO `cc1_it_issues` VALUES (36,84,'ARUUW9HAFE','Organization Contract - Org name on contract','<p>Top left line of contract, where organization name and contact person name should be, the contracts are leaving out the organization names completely. Organization names should be in Bold in front of the Contact person\'s name with a few spaces in between.</p>\r\n<p>\"<strong>Keller Early Learning Center    Karin Mahlenkamp\" </strong></p>',31,'2013-01-28 11:55:10',10,42,2,1,1,1,0,'0000-00-00 00:00:00',6,3,'2013-03-05 06:00:00','','0000-00-00 00:00:00','<p>Done</p>','2013-01-28 17:57:44','headcritter3','2013-02-08 14:45:06','headcritter1');
INSERT INTO `cc1_it_issues` VALUES (37,85,'ASL44F3AT4','Organization Contract - Date format','<p>Event date should read \"May 2, 2013\" instead of \"2013-05-02\"</p>',39,'2013-01-28 11:57:45',10,42,2,1,1,1,0,'0000-00-00 00:00:00',7,2,'2013-03-05 06:00:00','<p>Fixed (assuming you mean the one at the top of the contract).  I\'m hoping I can leave the one in the body text the way it is unless you prefer otherwise.</p>\r\n<p> </p>\r\n<p>** Kev, I actually did mean the one in the body. It\'s not an absolute MUST, but it keeps everything consistent throughout the contract instead of changing formats ...</p>\r\n<p>Done.</p>','0000-00-00 00:00:00','','2013-01-28 17:58:29','headcritter3','2013-02-07 15:52:21','headcritter1');
INSERT INTO `cc1_it_issues` VALUES (38,86,'A2BFJ54EOY','Organization Contract - Time display format.','<p>Event Time should state \"8:15 am - 12:15 pm\" instead of \"8:15 am for 4 hours\"</p>',31,'2013-01-28 11:58:30',10,42,2,1,1,1,0,'0000-00-00 00:00:00',8,2,'2013-03-05 06:00:00','<p>Done.</p>','0000-00-00 00:00:00','','2013-01-28 17:59:18','headcritter3','2013-02-07 15:53:00','headcritter1');
INSERT INTO `cc1_it_issues` VALUES (39,87,'AGU8X7RF86','Organization Contract - Price wrong - ponies not included.','<p>In list of fees and prices, Base Price comes out wrong a lot of the times. For example, one contract states \"Little Rancher petting zoo for 4 hours at 340.00\" The price should actually be $590, should include the dollar sign automatically and not include the \".00\"</p>',31,'2013-01-28 11:59:18',10,42,1,1,1,1,0,'0000-00-00 00:00:00',9,3,'2013-03-05 06:00:00','<p>Please send me an example of this one.  I have a suspicion, though, that it\'s not data-related.  It may be that the web server is responding too slow so sometimes people may change an option and hit \"SUBMIT\" before the site has had a chance to respond with the new price.  That  would require some tricky work.  I can do it, but it\'s not a quick-fix.</p>\r\n<p> </p>\r\n<p>I think I fixed this.  It seems like I had the wrong variable in the field.  I\'ll close it for now, but let me know if you see it again and I\'ll re-open the case.</p>\r\n<p>--</p>\r\n<p>K</p>','0000-00-00 00:00:00','','2013-01-28 18:00:30','headcritter3','2013-02-12 05:12:20','headcritter1');
INSERT INTO `cc1_it_issues` VALUES (40,88,'AE7HM7OTIC','Organization Contract - Travel fees','<p>Travel Fee line under list of prices is incorrect. Same issues as earlier travel feel section.</p>\r\n<p>Travel fee line currently states \"Travel fee ($2/mile, outside a 40-mile radius): $130.</p>\r\n<p>Firstly, I think we should delete the entire \"($2/mile ...)\" section. Not sure the customers really need to know that.</p>\r\n<p>Secondly, is it outside of a 40 or 50 mile radius?</p>\r\n<p>Thirdly, decide on the actual fee. Mileage now is $2/mile - LC and Cathy think it should be $1.5/ mile.</p>\r\n<p>Lastly, I\'m not sure the fee is calculating correctly. For example, the zip code to this particular $130 fee calculates to $122. Another contract was supposed to calculate to $170 but came up as $156.</p>',31,'2013-01-28 12:00:31',10,42,1,1,1,1,0,'0000-00-00 00:00:00',10,3,'2013-03-05 06:00:00','','0000-00-00 00:00:00','<p>Done</p>','2013-01-28 18:01:26','headcritter3','2013-02-08 14:48:09','headcritter1');
INSERT INTO `cc1_it_issues` VALUES (41,89,'APGCMP3UMC','Extra line after travel fee','<p>Extra line between \"Travel Fee\" and \"Total Price\" (or if there is no Travel fee, the extra line is between \"Base Price\" and \"Total Price\"). Line should be deleted.</p>',39,'2013-01-28 12:01:26',10,42,2,1,1,1,0,'0000-00-00 00:00:00',11,2,'2013-03-05 06:00:00','<p>I think I got this, let me know.</p>','0000-00-00 00:00:00','<p>Done</p>','2013-01-28 18:02:16','headcritter3','2013-02-08 14:49:00','headcritter1');
INSERT INTO `cc1_it_issues` VALUES (42,90,'AI3PDRQHZ2','Private Contract - Date format.','<p>Date line of contract should include which day of the week it is - for example \"Mar 02, 2013\" should now be \"Saturday, March 02, 2013\"</p>\r\n<p>It does this on the organization contracts already.</p>',39,'2013-01-28 12:03:27',10,42,2,1,1,1,0,'0000-00-00 00:00:00',12,2,'2013-03-05 06:00:00','<p>Done.</p>','0000-00-00 00:00:00','','2013-01-28 18:04:27','headcritter3','2013-02-07 16:03:07','headcritter1');
INSERT INTO `cc1_it_issues` VALUES (43,91,'AXUPHJU9JF','Time span format.','<p>On top right of contract, time should appear as \"10:30 am - 12:00 pm\" instead of \"10:30 am for 1.5 hours\"</p>',39,'2013-01-28 12:04:27',10,42,2,1,1,1,0,'0000-00-00 00:00:00',13,2,'2013-03-05 06:00:00','<p>Done.</p>','0000-00-00 00:00:00','','2013-01-28 18:05:20','headcritter3','2013-02-07 16:03:57','headcritter1');
INSERT INTO `cc1_it_issues` VALUES (44,92,'ANAW7YTEKQ','Private Contract - Missing $ sign.','<p>Top right corner of contract should include the $ sign in front of price</p>',39,'2013-01-28 12:05:20',10,42,2,1,1,1,0,'0000-00-00 00:00:00',14,2,'2013-03-05 06:00:00','','2013-02-07 06:00:00','<p>Done.</p>','2013-01-28 18:06:15','headcritter3','2013-02-07 16:05:02','headcritter1');
INSERT INTO `cc1_it_issues` VALUES (45,93,'A5BXBE77OE','Private Contract - Mileage','<p>Mileage sections - same as organization issues</p>',31,'2013-01-28 12:06:15',10,42,1,1,1,1,0,'0000-00-00 00:00:00',15,3,'2013-03-05 06:00:00','','0000-00-00 00:00:00','<p>Done, same as org contract</p>','2013-01-28 18:06:44','headcritter3','2013-02-08 14:50:00','headcritter1');
INSERT INTO `cc1_it_issues` VALUES (46,94,'ARMPQ8I3LF','Private Contract - Date format.','<p>Event date line should state \"Mar 2, 2013\" instead of \"2013-03-02\"</p>',31,'2013-01-28 12:06:45',10,42,2,1,1,1,0,'0000-00-00 00:00:00',16,2,'2013-03-05 06:00:00','','0000-00-00 00:00:00','<p>Done.</p>','2013-01-28 18:07:27','headcritter3','2013-02-08 14:50:29','headcritter1');
INSERT INTO `cc1_it_issues` VALUES (47,95,'AFWK8WZMTV','Private Contract - Time span format.','<p>Event time should state \"10:30 am - 12:00 pm\" instead of \"10:30 am for 1.5 hours\"</p>',31,'2013-01-28 12:07:27',10,42,2,1,1,1,0,'0000-00-00 00:00:00',17,2,'2013-03-05 06:00:00','','0000-00-00 00:00:00','<p>Done.</p>','2013-01-28 18:08:13','headcritter3','2013-02-08 14:51:15','headcritter1');
INSERT INTO `cc1_it_issues` VALUES (48,96,'AU14FZX1AC','Missing $ signs.','<p>Base Price section of contract should be correct price and should include $ sign in front of price</p>',39,'2013-01-28 12:08:14',10,42,2,1,1,1,0,'0000-00-00 00:00:00',18,1,'2013-03-05 06:00:00','<p>I don\'t see the problem.  I made a contract and all the prices have dollar signs.  Can you send me a sample?</p>','0000-00-00 00:00:00','<p>Fixed.  Added $ signs to prices.  Also added organization name and organizer\'s title.</p>','2013-01-28 18:08:51','headcritter3','2013-02-07 15:50:40','headcritter1');
INSERT INTO `cc1_it_issues` VALUES (49,97,'AGEKFPVXXU','Private Contract - General formatting','<p>Travel fee line of price section should include the same changes as the other travel fee sections. One more thing is that the words \"Travel Fee\" should be bold</p>',31,'2013-01-28 12:08:52',10,42,2,1,1,1,0,'0000-00-00 00:00:00',19,3,'2013-03-05 06:00:00','<p>I think the first part of this is addressed by my earlier change, however the bold formatting I haven\'t changed.  Looking at a recent contract email, it all looks pretty consistent.  Can you tell me what exactly should be bold and what should not?  For example, would you like *all* the field names bold and *all* the customer data normal? As in:</p>\r\n<p>Big Church In Austin <br />Kevin Smith, Honcho <br />Event date: Friday, February 08, 2013     Event time: 1:00 PM - 2:30 PM</p>\r\n<p>Billing Address:<br /> 100 Main St<br />Princeton, TX 75407<br /><br /> Party Locaton:<br /> 406 W 47th st<br />Austin, TX</p>\r\n<p>Price quotation:<br />Base Price:  Little Rancher petting zoo plus 1 ponies for 1.5 hours at $410<br />Travel fee ($1.5/mile, outside a 40-mile radius): $354.<br />Optional setup and cleanup on concrete: $50<br />Total price $814<br />Deposit Due: $407<br />Remainder due at event $407<br /><br />========</p>\r\n<p>Still looking for confirmation on this.  Your thoughts?</p>\r\n<p> </p>','0000-00-00 00:00:00','<p>I reversed all the boldface so that the field descriptors are normal and the customer information is bold.  Also, the party loacation is in RED so you can\'t miss it <img src=\"media/editors/tinymce/jscripts/tiny_mce/plugins/emotions/img/smiley-sealed.gif\" border=\"0\" alt=\"Sealed\" title=\"Sealed\" /></p>\r\n<p>--</p>\r\n<p>Keb\'m</p>','2013-01-28 18:09:46','headcritter3','2013-02-13 04:55:32','headcritter1');
INSERT INTO `cc1_it_issues` VALUES (50,98,'AKCAN1H7YP','Private Contract - Pricing info formatting.','<p>Extra line between Travel fee and Total price (or base price and total price)should be deleted</p>',31,'2013-01-28 12:09:47',10,42,2,1,1,1,0,'0000-00-00 00:00:00',20,2,'2013-03-05 06:00:00','<p>Are we good on this one?</p>','0000-00-00 00:00:00','<p>I think this one\'s done.  Let me know if formatting still needs any tweaks.</p>','2013-01-28 18:10:28','headcritter3','2013-02-17 19:53:46','headcritter1');
INSERT INTO `cc1_it_issues` VALUES (51,99,'A4LZNFF9XK','Online Booking Form - Default name &quot;Jones&quot; - remove it.','<p>On the booking forms, my section always gives a last name as \"Jones\" -- is that just mine or does that show up for everyone?</p>',31,'2013-01-28 12:10:28',10,42,1,1,1,1,0,'0000-00-00 00:00:00',21,2,'2013-03-05 06:00:00','<p>Fixed.</p>','0000-00-00 00:00:00','<p>Fixed.</p>','2013-01-28 18:17:53','headcritter3','2013-02-12 05:16:38','headcritter1');
INSERT INTO `cc1_it_issues` VALUES (52,100,'ARWV6135GF','Online Booking Form - Add WWS to form','<p>On the drop down menu of the petting zoo\'s, we should probably include the World Wide Safari as a package.</p>',31,'2013-01-28 12:17:54',10,42,1,1,1,1,0,'0000-00-00 00:00:00',22,3,'2013-03-05 06:00:00','','0000-00-00 00:00:00','<p>Done, only for organizations.  Prefer to keep G&F and IDY as the standard hands-on educational event for small groups, and WWS for auditorium-sized groups.  Helps Cathy know what she\'s walking into...</p>','2013-01-28 18:19:01','headcritter3','2013-02-13 05:01:19','headcritter1');
INSERT INTO `cc1_it_issues` VALUES (53,101,'AO5FF4Q5WS','Booking Form - Party durations - make specific to party type.','<p>Party durations should start at 1 hour and go beyond 4 hours.... now that I think about it we can\'t do that because we don\'t book the Babies for Babies normally past 2 - 3 hours. Is there a way to take off certain time lengths when you select a certain item? That would solve our 1 hour party dilemna too. We really need the 1 hour events up though for the IDY and GNFL.</p>',31,'2013-01-28 12:19:02',10,42,1,1,1,1,0,'0000-00-00 00:00:00',23,3,'2013-03-05 06:00:00','<p>Yes, I can do this, but it will take a little work.  Will make this one \"In Progress\" and start working on it next.</p>\r\n<p> </p>','2013-04-24 17:04:53','<p><br />2013/04/24 - I have it working, but it\'s a bit kludgy.  Since there is a JS script that needs to be run, it re-runs when the customer has to go BACK to fill in extra information, and they always have to re-choose the party duration.  Maybe I could fix this, but I will consider it done unless we spend lots of time hand-holding with confused customers.</p>','2013-01-28 18:20:38','headcritter3','2013-04-24 17:04:53','headcritter1');
INSERT INTO `cc1_it_issues` VALUES (54,102,'AP2B17UI7G','Booking Form - Pony defaults and max','<p>Pony section should automatically start at no ponies. Just more user friendly. We also need to somehow include up to 5 ponies per package.</p>',31,'2013-01-28 12:20:38',10,42,1,1,1,1,0,'0000-00-00 00:00:00',24,3,'2013-03-05 06:00:00','','0000-00-00 00:00:00','<p>Done.  Max for birthday parties is 3, max for organizations is 7.  Default for both is \"No ponies, thank you\". </p>','2013-01-28 18:21:28','headcritter3','2013-02-17 19:48:43','headcritter1');
INSERT INTO `cc1_it_issues` VALUES (55,103,'AY2BZSLW8X','Booking Form -Photo defaults','<p>Photo souvenirs section should be automatically unchecked - one customer suggested adding a \"Yes\" or \"No\" type of selection</p>',31,'2013-01-28 12:21:29',10,42,1,1,1,1,0,'0000-00-00 00:00:00',25,2,'2013-03-05 06:00:00','','0000-00-00 00:00:00','<p>Done - default of \"souvenir photos\" is UNchecked.</p>','2013-01-28 18:22:13','headcritter3','2013-02-17 19:52:52','headcritter1');
INSERT INTO `cc1_it_issues` VALUES (56,104,'A4ZYWBBCZH','Booking Form - Confirmation screen','<p>When customers select their deposit payment method and choose PayPal, there should be a middle screen that confirms the event was booked and allows them to go to the PayPal screen after. Also, can we include a selection to pay via credit card over the phone? It could take them to the confirmation screen and then give them the phone number and office hours.</p>',31,'2013-01-28 12:22:13',10,42,1,4,1,1,0,'0000-00-00 00:00:00',26,3,'2013-03-05 06:00:00','','0000-00-00 00:00:00','','2013-01-28 18:24:06','headcritter3','2013-02-13 05:02:44','headcritter1');
INSERT INTO `cc1_it_issues` VALUES (57,105,'AQPPPI7DAU','Booking Form - Verbiage at top of contract.','<p>At the top of both forms, it says something that is a little wrong.</p>\r\n<p>On the private contract form is states: \"Book your <span style=\"text-decoration: underline;\">private party</span> petting zoo party today! For other parties or public events, we\'ll have an on-line form soon, but for now please call the office and talk to Lisa.\"</p>\r\n<p>On the public contract form it states: \"Book your organization\'s petting zoo party today! For private parties or other animal education services, please choose the appropriate menu item above.\"</p>\r\n<p>Both of those should be adjusted to be more accurate. Since the public form is still having issues, we should put some form of \"please call or email to confirm the details are correct, website is still under construction\" or something like that.</p>',31,'2013-01-28 12:24:06',10,42,1,1,1,1,0,'0000-00-00 00:00:00',27,3,'2013-03-05 06:00:00','<p>Fixed.  Thanks.</p>','0000-00-00 00:00:00','','2013-01-28 18:27:11','headcritter3','2013-02-17 19:12:30','headcritter1');
INSERT INTO `cc1_it_issues` VALUES (58,106,'AZY7WUEVWP','Credit Card Company - Issue 1','<p>Ask about fees and see if we can adjust how the fees are taken out.</p>',31,'2013-02-04 12:13:40',10,42,5,4,1,1,0,'0000-00-00 00:00:00',28,2,'2013-03-05 06:00:00','','0000-00-00 00:00:00','','2013-02-04 18:14:59','headcritter3','2013-02-04 12:14:59','critters_kevin@localhost');
INSERT INTO `cc1_it_issues` VALUES (61,107,'AFR3KM821Y','Testing the IT system','<p>Here\'s a nice description.</p>',31,'2013-02-06 14:07:26',10,57,4,4,1,-2,0,'0000-00-00 00:00:00',29,2,'2013-02-07 06:00:00','<p>Trying to crash the system like Lisa did.</p>','0000-00-00 00:00:00','','2013-02-06 20:08:36','headcritter1','2013-02-06 14:08:36','critters_kevin@localhost');
INSERT INTO `cc1_it_issues` VALUES (62,108,'AV28G9G4E5','Private Contract - Issue 10','<p>When a customer selects the option of a separate party location, the layout on the contract itself is a little funky. It looks like this:</p>\r\n<p><br /><strong>Party Location:<br /></strong></p>\r\n<p>4 Janna Way<strong><br /></strong></p>\r\n<p>                                ------- notice that there is an extra line here that needs to e deleted</p>\r\n<p>Lucas, Tx 75002</p>\r\n<p> </p>\r\n<p>1017 Mellville Dr        ----- also note that there is n \"Billing Address\" above the second address so it\'s a little confusing.</p>\r\n<p>Plano, Tx 75075</p>\r\n<p> </p>\r\n<p>I believe it does the same on the organization contracts as well.</p>',39,'2013-02-07 09:46:12',10,42,2,1,1,1,0,'0000-00-00 00:00:00',30,3,'2013-03-05 06:00:00','<p> </p>\r\n<p> </p>','0000-00-00 00:00:00','<p>Added the \"Billing Address:\" to the contract.  The empty line for \"Address Line 2\" has already been gone for a while.</p>','2013-02-07 15:48:45','headcritter3','2013-02-17 19:27:28','headcritter1');
INSERT INTO `cc1_it_issues` VALUES (63,109,'ADFTDSADVW','Organization Contract - Issue 11','<p>This may be similar to other issues, but here goes.</p>\r\n<p> </p>\r\n<p>On the top right section of the contract where it states the time, etc. You added in the name of the organization. (I can send you a sample contract if needed). Is there a way to take it off the right section? It\'s kind of jumbled up there. If not, please add a blank line below the date and the start of the right section otherwise it\'s all too close</p>',39,'2013-02-07 09:50:15',10,42,2,1,1,1,0,'0000-00-00 00:00:00',31,2,'2013-03-05 06:00:00','','0000-00-00 00:00:00','<p>I put the user\'s last name and organization on separate lines.  See if that helps the appearance.</p>','2013-02-07 15:51:57','headcritter3','2013-02-17 19:35:10','headcritter1');
INSERT INTO `cc1_it_issues` VALUES (64,112,'A3WOCU6ROX','Private Contract - extra line to be deleted','<p>Extra line between \"Base Price:...\" and \"Total Price: ....\" Not really sure if this issue is already created or not - sorry!</p>',39,'2013-02-18 10:02:53',10,42,2,4,1,1,0,'0000-00-00 00:00:00',32,2,'2013-03-05 06:00:00','','0000-00-00 00:00:00','','2013-02-18 16:03:45','headcritter3','2013-02-18 10:03:45','critters_kevin@localhost');
INSERT INTO `cc1_it_issues` VALUES (69,122,'AUKF3881VW','test','<p>test</p>',39,'2013-04-24 12:35:13',10,42,1,4,1,1,0,'0000-00-00 00:00:00',33,1,'2013-04-25 05:00:00','<p>Fixed?</p>','0000-00-00 00:00:00','','2013-04-24 17:36:00','headcritter1','2013-04-24 12:36:00','critters_kevin@localhost');
INSERT INTO `cc1_it_issues` VALUES (70,123,'AC5GAHSWYM','&quot;Book An Event&quot; button - make it un-clickable','<p>When customers click on the \"Book an Event\" (instead of going to the drop down menu and clicking on Private or Public) it takes them directly to the private event contract. So I keep getting customers booking organization events but using the private contract. Is there a way to make that button un-clickable - so that they have to choose from the drop down menu? Or, can that button take them to the page where they select \"Private\" or \"Public\" and then it takes them to the correct contract?</p>',39,'2013-04-25 11:52:35',10,42,2,4,1,1,0,'0000-00-00 00:00:00',34,3,'0000-00-00 00:00:00','','0000-00-00 00:00:00','<p>Done!</p>\r\n<p><br />I had to let clicking on it do *something*, so I just made it go to an innocuous article \"About Us\" instead of an actual form.  Hopefully that will send the message to the user that they need to choose from the pulldown.</p>','2013-04-25 16:59:03','headcritter3','2013-04-25 19:35:21','headcritter1');
