INSERT INTO `cc1_joomblog_posts` VALUES (6,69,'Welcome to Cathy\'s Critters','welcome-to-cathys-critters','<p><span style=\"font-size: 15px; font-family: Arial; color: #000000; background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline;\">Hi, friends!<br /></span></p>\r\n<p><span style=\"font-size: 15px; font-family: Arial; color: #000000; background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline;\"><img src=\"images/kidsandanimals/dsc09191.jpg\" border=\"0\" alt=\"Cathy presenting WorldWide Safari\" width=\"196\" height=\"140\" style=\"border: 6px solid white; float: left;\" /></span></p>\r\n<p><span style=\"font-size: 15px; font-family: Arial; color: #000000; background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline;\">Welcome to the Cathy\'s Critters blog!  We\'ve been a little behind the curve on social media, although we have had lots to say and share since beginning our business almost 8 years ago.  We started our business with a static 5-page web site listing prices and packages and a few pictures. </span></p>\r\n<p><br /><span style=\"font-size: 15px; font-family: Arial; color: #000000; background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline;\">While we haven\'t crowed about it online much, Cathy’s Critters has been a community name in the DFW area for almost 8 years. We’ve brought our animals to hundreds of birthday parties, festivals, summer camps, church, and civic events and we’ve been lucky enough to be the cause of countless smiles as kids learn gentleness, patience, and humor while holding rabbits, riding ponies, or having their hair nibbled by miniature goats. </span></p>\r\n<p><span style=\"font-size: 15px; font-family: Arial; color: #000000; background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline;\">Since our founding, we’ve also started “Critter Camp,” a week-long summer camp where kids learn to milk goats, ride horses, and do crafts and biology experiments. On the last night, the kids get to camp beneath the stars and see the constellations that are usually obscured by the light pollution in the cities and suburbs where they live. </span><br /><br /><span style=\"font-size: 15px; font-family: Arial; color: #000000; background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline;\">When we started Cathy’s Critters, the purpose of the company was to pay for Cathy’s many pets. When she and her family moved out to 18 acres in the country, she began raising all the animals she never could while living in suburbia -- goats, birds, horses, chickens, pigs. But those animals quickly became very expensive. Between vet bills, hay, housing, and feed, it was time for the animals to earn their keep! </span><br /><br /><span style=\"font-size: 15px; font-family: Arial; color: #000000; background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline;\">But as the company grew, Cathy’s mission evolved. She found a real purpose in teaching children about animals, and she developed a strong belief in the power of human-animal interaction. She observed shy children who would open up when they spent time around the animals. She watched autistic children who had a hard time relating to humans discover a connection with an animal. She watched babies as they learned to control their motor skills while petting a rabbit. She watched children with ADD find focus and concentration when bottle-feeding a baby goat. She witnessed these types of interactions over and over and it became apparent to her that animal interaction is an important part of any child’s development. It encourages empathy and understanding and can help children become responsible, well-rounded, and loving adults.  </span><br /><br /><span style=\"font-size: 15px; font-family: Arial; color: #000000; background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline;\">As this belief gets embedded more and more deeply into the mission and vision of Cathy’s Critters, our goal is to reach as many people as we can with our message. That’s why we’re starting this online campaign. To educate and inform. To share our passion. </span><br /><br /><span style=\"font-size: 15px; font-family: Arial; color: #000000; background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline;\">And we couldn’t do that without you, our audience. So thank you, sincerely, for reading. For more news and updates, subscribe to this blog, “like” us on Facebook, and follow us on Twitter.</span><br /><br /><span style=\"font-size: 15px; font-family: Arial; color: #000000; background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline;\">Until next time,</span><br /><span style=\"font-size: 15px; font-family: Arial; color: #000000; background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline;\">The Cathy’s Critters Team </span><br /><br /><span style=\"font-size: 15px; font-family: Arial; color: #000000; background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline;\">P.S. Happy Holidays! </span></p>','',1,17,'2012-12-18 06:00:00',42,'2012-12-20 20:51:27',42,'2012-12-20 06:00:00','0000-00-00 00:00:00','{\"alternative_readmore\":\"read more...\"}',11,0,2,'','',1,478,'{\"metakey\":\"\",\"metadesc\":\"\",\"page_image\":\"\",\"ogdesc\":\"\"}','*',0);
INSERT INTO `cc1_joomblog_posts` VALUES (7,76,'Do Chinchillas Take Baths?','do-chinchillas-take-baths','<p><span style=\"color: #413d21; font-family: arial,helvetica,sans-serif; font-size: 13px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; background-color: #ffffff; display: inline ! important; float: none;\"><img src=\"images/chinchillas_at_work.jpeg\" border=\"0\" alt=\"Chinchillas &amp; TPS Reports\" title=\"Chinchillas in the Office! \" width=\"295\" height=\"222\" style=\"float: left; margin-left: 10px; margin-right: 10px; border: 2px solid black;\" />Here at Cathy’s Critters, there are animals everywhere you turn -- even in the office! Along with a couple of cockatiels, a ball python, and a bearded dragon, we have handful of chinchillas that keep Lisa and I company while we take calls from customers and schedule events.</span><br style=\"color: #413d21; font-family: arial,helvetica,sans-serif; font-size: 13px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; background-color: #ffffff;\" /><br style=\"color: #413d21; font-family: arial,helvetica,sans-serif; font-size: 13px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; background-color: #ffffff;\" /><span style=\"color: #413d21; font-family: arial,helvetica,sans-serif; font-size: 13px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; background-color: #ffffff; display: inline ! important; float: none;\">If you haven’t seen the chinchillas at a<span class=\"Apple-converted-space\"> </span></span><a href=\"http://petsupervisor.com/index.php/services/indoor-presentations\" style=\"margin: 0px; padding: 0px; font-family: Tahoma,Arial,Helvetica,sans-serif; color: #8f8649; font-size: 13px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; background-color: #ffffff;\">World Wide Safari</a><span style=\"color: #413d21; font-family: arial,helvetica,sans-serif; font-size: 13px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; background-color: #ffffff; display: inline ! important; float: none;\"><span class=\"Apple-converted-space\"> </span>presentation, they are a small rodent native to the Andes Mountains in South America. They’re known for their extremely soft fur. In fact, they have the second densest fur of any mammal (the first is the sea otter!).<span class=\"Apple-converted-space\"> </span></span></p>\r\n','\r\n<p><span style=\"color: #413d21; font-family: arial,helvetica,sans-serif; font-size: 13px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; background-color: #ffffff; display: inline ! important; float: none;\">Chinchillas make great first pets because they are quiet, well-mannered, and relatively clean. They also become very personable when handled often, and are even hypoallergenic! They do require some special care, including being kept at a temperature below 80° degrees (they can’t release heat with sweat like humans do, so could suffer a heat stroke if they get too warm). They also need a multi-level cage with a home that they can hide in to replicate the climbing and burrowing they would do in the wild.  Just be sure to do your research before adopting one into your family!<span class=\"Apple-converted-space\"> </span></span><br style=\"color: #413d21; font-family: arial,helvetica,sans-serif; font-size: 13px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; background-color: #ffffff;\" /><br style=\"color: #413d21; font-family: arial,helvetica,sans-serif; font-size: 13px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; background-color: #ffffff;\" /><span style=\"color: #413d21; font-family: arial,helvetica,sans-serif; font-size: 13px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; background-color: #ffffff; display: inline ! important; float: none;\">One interesting fact about chinchillas is that they never need a bath! Well, ok... that’s not entirely true. They just don’t need baths like you and I do, with water, shampoo, soap and a loofah. In fact, this sort of bath would be harmful to their fur. Chinchillas have an average of 60 hairs per follicle (while humans only have 1) and because of the density of their fur, they can’t air dry like a dog or a cat can after a bath. The moisture in the fur of a wet chinchilla can trigger the growth of fungus or bacteria. So how do they stay clean?<span class=\"Apple-converted-space\"> </span></span><br style=\"color: #413d21; font-family: arial,helvetica,sans-serif; font-size: 13px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; background-color: #ffffff;\" /><br style=\"color: #413d21; font-family: arial,helvetica,sans-serif; font-size: 13px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; background-color: #ffffff;\" /><span style=\"color: #413d21; font-family: arial,helvetica,sans-serif; font-size: 13px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; background-color: #ffffff; display: inline ! important; float: none;\">In the wild, chinchillas roll around in volcanic rock that has been naturally ground down to fine powder. The dry dust pulls out the oils and dirt from the Chinchilla’s fur, leaving them clean and soft. Domesticated chinchillas still have to keep clean, but it’s hard to find actual volcanic rock from the Andes for them to bathe in! Instead, you can find a packaged dust made out of pumice at most pet stores.<span class=\"Apple-converted-space\"> </span></span></p>\r\n<p><span>Our chinchillas obviously aren’t shy about bathing in public! Take a look a video of one of our little rodents showing off in front of a big group of kids at a presentation this past December.</span></p>\r\n<p><span style=\"color: #413d21; font-family: arial,helvetica,sans-serif; font-size: 13px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; background-color: #ffffff; display: inline ! important; float: none;\"><iframe style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"http://www.youtube.com/embed/a_OUKeXE-VU\" frameborder=\"0\" width=\"569\" height=\"320\"></iframe></span></p>\r\n<p><br style=\"color: #413d21; font-family: arial,helvetica,sans-serif; font-size: 13px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; background-color: #ffffff;\" /><span style=\"color: #413d21; font-family: arial,helvetica,sans-serif; font-size: 13px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; background-color: #ffffff; display: inline ! important; float: none;\">Have questions about raising a chinchilla or want to share pictures of your own pet? Leave us a comment in the section below -- we love hearing from you! And to keep in touch with Cathy’s Critters, don’t forget to<span class=\"Apple-converted-space\"> </span></span><a href=\"https://www.facebook.com/cathys.critters1\" style=\"margin: 0px; padding: 0px; font-family: Tahoma,Arial,Helvetica,sans-serif; color: #8f8649; font-size: 13px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; background-color: #ffffff;\">“like” us on Facebook</a><span style=\"color: #413d21; font-family: arial,helvetica,sans-serif; font-size: 13px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; background-color: #ffffff; display: inline ! important; float: none;\"> and </span><a href=\"https://twitter.com/CathyCritterZoo\" style=\"margin: 0px; padding: 0px; font-family: Tahoma,Arial,Helvetica,sans-serif; color: #8f8649; font-size: 13px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; background-color: #ffffff;\">follow us on Twitter</a><span style=\"color: #413d21; font-family: arial,helvetica,sans-serif; font-size: 13px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; background-color: #ffffff; display: inline ! important; float: none;\">!</span><br style=\"color: #413d21; font-family: arial,helvetica,sans-serif; font-size: 13px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; background-color: #ffffff;\" /><br style=\"color: #413d21; font-family: arial,helvetica,sans-serif; font-size: 13px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; background-color: #ffffff;\" /><span style=\"color: #413d21; font-family: arial,helvetica,sans-serif; font-size: 13px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; background-color: #ffffff; display: inline ! important; float: none;\">Hugs &amp; Critters,</span><br style=\"color: #413d21; font-family: arial,helvetica,sans-serif; font-size: 13px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; background-color: #ffffff;\" /><span style=\"color: #413d21; font-family: arial,helvetica,sans-serif; font-size: 13px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; background-color: #ffffff; display: inline ! important; float: none;\">Cathy</span></p>',1,17,'2013-01-08 01:53:34',50,'2013-02-17 05:09:17',42,'2013-01-08 01:53:00','0000-00-00 00:00:00','{\"alternative_readmore\":\"\"}',8,0,0,'','',1,461,'{\"metakey\":\"\",\"metadesc\":\"\",\"page_image\":\"\",\"ogdesc\":\"\"}','*',0);
INSERT INTO `cc1_joomblog_posts` VALUES (8,77,'Whatcha\' Eatin\'?','herbivores-carnivores-omnivores','<p><img src=\"images/animals/ChickenAndCat.jpg\" border=\"0\" alt=\"Cat checking out the chicken\" title=\"Whatcha\' Eatin\'?\" width=\"121\" height=\"163\" style=\"float: left; margin-right: 4px;\" /></p>\r\n<p> </p>\r\n<p>Life surrounds us here on the farm. I love watching all the goats, llamas and cows grazing in the pastures while the dogs chase a squirrel up a tree. People often ask how all these animals live together and wonder if it\'s really all ‘peace and harmony’? The short answer is \"no\", but the question brings up an interesting aspect of the animal kingdom -- how we classify all these different species. There are several ways to group animals, but one of the easiest is by their diet.  The three most common dietary classifications are carnivore, omnivore, and herbivore.  Let’s take a look at each classification and  see which animals on the farm belong to which category.</p>\r\n<h3> </h3>\r\n<h4>Herbivores</h4>\r\n<h3><img src=\"images/animals/Llama.JPG\" border=\"0\" alt=\"Llama\" title=\"What are you looking at?\" width=\"259\" height=\"172\" style=\"float: right; margin-right: 4px;\" /></h3>\r\n<p>The herbivore is probably the largest group of animals here on the farm.  The word herbivore can be broken down into two parts: <span style=\"text-decoration: underline;\">herba,</span> meaning a small plant or herb; and <span style=\"text-decoration: underline;\">vora</span>, meaning to eat or devour.  These animals eat plants almost exclusively. Their anatomy and digestive systems make it possible to digest the hard outer cellular wall of plant matter.  Key features of herbivores are flat-surfaced back teeth for grinding and a very long intestinal tract.  Herbivores are known as primary consumers.  Many farm animals, including cows, goats, horses and llamas, are herbivores.  Also, most rodents are also classified as herbivores.</p>\r\n<h3> </h3>\r\n<h3><img src=\"images/animals/Izzie.JPG\" border=\"0\" alt=\"Cute?  Don\'t let her fool you...\" title=\"Izzie\" width=\"235\" height=\"156\" style=\"float: left;\" /></h3>\r\n<h4 style=\"text-align: right;\"> </h4>\r\n<h4 style=\"text-align: right;\">Carnivores</h4>\r\n<p>Farmers are often trying to protect their herd against animals that only eat meat -- coyotes, wild cats, and wolves, for example. These animals are carnivores. True carnivores depend on the nutrients found only in animal flesh. They may consume small amounts of plant material but they cannot physically digest vegetable matter.  The carnivore also has several physical characteristics that reveal their dietary needs.  The most obvious are their large fangs known as canine teeth.  These teeth are used to hold onto and tear up food.  Most carnivores also have eyes that face forward rather than out to the side like many herbivores.  The forward-facing eyes gives them better depth perception, and an advantage in hunting and killing their food.  In the food chain, the carnivore is on top and is known as a predator.  So would a farm have many carnivores living amongst the herbivores?  Probably not.  However the best known carnivore is considered  “man’s best friend” -- your dog!  Dogs and cats are both carnivores.  Next time your dog or cat opens its mouth, take a look at those large canine teeth.  We do have a few other exotic carnivores on the farm, like ferrets,  and we must be very careful not to let them around any of our smaller herbivorous friends. </p>\r\n<h3> </h3>\r\n<h4>Omnivores</h4>\r\n<p>The last category of animals, grouped by diet, is the omnivore. If we break this word down into its latin orgins we see that <span style=\"text-decoration: underline;\">omni</span> <img src=\"https://sphotos-a.xx.fbcdn.net/hphotos-ash3/578009_399238266823223_1784704241_n.jpg\" border=\"0\" alt=\"sugarglider baby\" title=\"Sugargilder \" width=\"161\" height=\"240\" style=\"float: right;\" />means \"all\" or \"everything\", and <span style=\"text-decoration: underline;\">vorae</span> means to devour.  These animals can eat both animal and plant matter.  The omnivore <br class=\"Apple-interchange-newline\" /><br />usually has characteristics similar to the carnivore in that it has canine teeth but also has crushing teeth like herbivores.  We have <br />several different types of omnivores on the farm.  These include pigs, chickens and the farmers... humans are omnivores, too!  We also have coatimundis, hedgehogs and sugargliders that fit into this category. </p>\r\n<p>Next time you see an animal in your neighborhood, at the park, or even a pet store, try to think like a zoologist and figure out what classification the critter fits into by looking a little bit closer at it. Finding out how animals in our environment work together and depend on each other gives us a deeper understanding of the animal kindgom, and our world! </p>\r\n<p> </p>\r\n<p>Hugs and Critters,</p>\r\n<p>Cathy<br /><br /></p>\r\n<p> </p>\r\n<p> </p>','',1,17,'2013-01-17 03:18:41',50,'2013-02-23 01:49:26',42,'2013-01-17 03:18:00','0000-00-00 00:00:00','{\"alternative_readmore\":\"\"}',28,0,0,'','',1,391,'{\"metakey\":\"\",\"metadesc\":\"\",\"page_image\":\"\",\"ogdesc\":\"\"}','*',0);
INSERT INTO `cc1_joomblog_posts` VALUES (14,124,'Cheese-making class on the farm','volunteer-open-house-cheese-making','<p>RSVP <strong>today</strong> by sending an email to kevin@cathys-critters.com, or by posting a comment to this blog.</p>\r\n<p>Please forward to any friends that may be interested, share on Facebook, etc...</p>\r\n<p> </p>\r\n<p><img src=\"images/logo/logo_432.png\" border=\"0\" width=\"319\" height=\"159\" style=\"float: right;\" /></p>\r\n<p><strong>EVENT</strong>:  Wine and cheese social open house with cheese-making class - mozzarella (Critter Camp recipe)<br /><br /><strong>DATE</strong>:  Sunday, May 12th<br /><br /><strong>TIME</strong>: 2:00 - whenever  (Cheese making will be from about 2:30-3:30)<br /><br /><strong>WHERE</strong>: Cathy\'s Critters Farm, Activity Building</p>\r\n<p>    7422 County Road 466</p>\r\n<p>    Princeton, TX 75407</p>\r\n<p><strong>IF YOU MISS A TURN:</strong> Call the office: 972-562-0583 and we\'ll walk ya\' through it.<br /><br /><strong>WHY?</strong>:  <br />1)  To build familiarity among our volunteers<br />2)  Solicit other potential volunteers<br />3)  Drink wine and box with kangaroos (No wine served to minors.  Nor to kangaroos)<br /><br /><img src=\"images/cheesemaking/StrainingTheCurd270.jpg\" border=\"0\" width=\"125\" height=\"188\" style=\"float: left; margin-left: 10px; margin-right: 10px;\" />You\'re invited to our first volunteer open house and cheese-making class!  <br /><br />So far our volunteer program at Cathy\'s Critters has been a great success.  We have goat-milking shifts covered nearly every day, but can always use more trained milkers as alternates and for day-sharing arrangements with other volunteers.<br /><br /><img src=\"images/cheesemaking/OfficialTaster270.jpg\" border=\"0\" alt=\"\" width=\"110\" height=\"165\" align=\"right\" />To that end, I\'d like to cordially welcome you to the farm for some wine, cheese, and cheese-making.  Space is limited, so I can handle about 20 people in the activity room where we will work, so please sign up soon.  If we have more than that sign up, I won\'t turn anyone away, but I may ask for a little help on the wine ;-)</p>\r\n<p>Anything you learn here can be applied at home, even without your own goats. </p>\r\n<p> </p>\r\n<p> </p>\r\n<p><br /><strong>About us:</strong><br /><img src=\"images/Critters_web_logo.jpg\" border=\"0\" alt=\"\" align=\"left\" />Cathy\'s Critters is entering its ninth year of serving the DFW metro area with animal-related education and entertainment services.  We bring mobile petting zoos and ponies to birthday parties, easter egg hunts, school and church carnivals, and other events.  We have also leased animal talent to featured spots on Good Morning Texas, and for independent film makers.  This summer we\'ll have our fourth year of \"Critter Camp\" a week-long day camp (5 sessions) dedicated to animal care, farm education, science, and outdoor fun on the farm.  We have an activity building for weather-proof celebrations, meetings, and classes and are currently using it for birthday parties on the farm and field trips.  Finally, we have partnered up with Myers Park and Events Center to present a field trip for classrooms from all over North Texas called \"Schoolhouse Farm and Friends\".  We have recently incorporated a new entity called \"Human-Animal Interaction and Education Advocates\" with the intent of applying for 501c3 non-profit status as an charitable, educational, and scientific organization.  In addition to the educational services we already provide, we will also start an animal-assisted therapy program under this organization to provide therapeutic animals to the counseling and rehab community, and for kids with learning disabilities or special needs.<br /><br /><strong>About me:</strong></p>\r\n<p><img src=\"images/cheesemaking/SecretIngredient.jpg\" border=\"0\" alt=\"The secret ingredient to 30-minute mozzarella\" title=\"SecretIngredient\" width=\"102\" height=\"68\" style=\"float: left; margin-left: 12px; margin-right: 12px;\" />Kevin Smith will be your <a href=\"http://www.wordreference.com/fren/fromager\" target=\"_blank\">fromager</a>.  He has no qualifications for this except having made a few batches from goat\'s milk and teaching it to our campers at Critter Camp for each of the last 3 years.  He has made a batch or two of farmhouse cheddar, which was edible but not great, and twice tried to make brie which he ate only because he felt sorry for it.  He promises that the mozzarella will be stretchy.  Thanks to Amanda for suggesting that I translate cheesemaker to French, since there is no fancy word for it in English.<br /><br /></p>','',1,17,'2013-05-03 15:07:37',42,'2013-05-09 14:30:16',42,'2013-05-03 15:07:39','2013-05-06 15:07:41','{\"alternative_readmore\":\"\"}',10,0,0,'','',1,144,'{\"metakey\":\"\",\"metadesc\":\"\",\"page_image\":\"\",\"ogdesc\":\"\"}','*',0);
INSERT INTO `cc1_joomblog_posts` VALUES (15,125,'Mothers Day','mothersday-cheese-making','<p>Happy mothers day.</p>\r\n<p>This mothers day <span style=\"color: #ff0000;\">Cathys Critters</span> held a <span style=\"text-decoration: underline;\">cheese making</span> and wine tasting celebration.<img style=\"margin: 10px 20px 10px 0px; float: left;\" alt=\"Cheesy lecture\" src=\"images/cheesemaking/temp.jpg\" height=\"291\" width=\"438\" /></p>\r\n<p>&nbsp;</p>\r\n<p>And here is the first paragraph of stuff we want to add.&nbsp; It\'s hard to come up with much to say when your mind is empty because you haven\'t yet had enough coffee.</p>\r\n<p>&nbsp;</p>\r\n<p>What about Waldo?&nbsp; Did anyone really find him?&nbsp; Did he go and get himself lost again? What about Waldo?&nbsp; Did anyone really find him?&nbsp; Did he go and get himself lost again?What about Waldo?&nbsp; Did anyone really find him?&nbsp; Did he go and get himself lost again?What about Waldo?&nbsp; Did anyone really find him?&nbsp; Did he go and get himself lost again?What about Waldo?&nbsp; Did anyone really find him?&nbsp; Did he go and get himself lost again?What about Waldo?&nbsp; Did anyone really find him?&nbsp; Did he go and get himself lost again?What about Waldo?&nbsp; Did anyone really find him?&nbsp; Did he go and get himself lost again?What about Waldo?&nbsp; Did anyone really find him?&nbsp; Did he go and get himself lost again?What about Waldo?&nbsp; Did anyone really find him?&nbsp; Did he go and get himself lost again?What about Waldo?&nbsp; Did anyone really find him?&nbsp; Did he go and get himself lost again?What about Waldo?&nbsp; Did anyone really find him?&nbsp; Did he go and get himself lost again?What about Waldo?&nbsp; Did anyone really find him?&nbsp; Did he go and get himself lost again?What about Waldo?&nbsp; Did anyone really find him?&nbsp; Did he go and get himself lost again?</p>','',0,17,'2013-05-13 13:54:23',92,'2013-05-13 14:07:38',92,'2013-05-13 13:54:00','0000-00-00