INSERT INTO `cc1_joomblog_posts` VALUES (10,113,'Raising active kids means raising healthy kids.','farm-kids-healthier','<p><strong id=\"internal-source-marker_0.36245005298405886\" style=\"color: #000000; font-family: \'Times New Roman\'; font-size: medium; font-style: normal; font-variant: normal; letter-spacing: normal; line-height: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-size-adjust: auto; -webkit-text-stroke-width: 0px; font-weight: normal;\"><span style=\"font-size: 15px; font-family: Arial; color: #000000; background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: initial; vertical-align: baseline; white-space: pre-wrap;\"><img src=\"images/blogposts/farmkids/FarmKids-262x300.jpg\" border=\"0\" alt=\"Farm kids, circa 1930\" width=\"168\" height=\"193\" style=\"margin-right: 15px; float: left;\" />I moved with my family of five to the farm that is Cathy’s Critters nearly 10 years ago. While we’d always been a pretty active, outdoorsy family with lots of animals running around, the kids had to transition from a life in suburbia to one on a working hobby farm. Their chore list grew from cleaning their rooms and helping with the dishes to feeding horses and cleaning out rabbit cages. </span></strong></p>\r\n<p><strong style=\"color: #000000; font-family: \'Times New Roman\'; font-size: medium; font-style: normal; font-variant: normal; letter-spacing: normal; line-height: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-size-adjust: auto; -webkit-text-stroke-width: 0px; font-weight: normal;\"> </strong></p>\r\n<p><strong style=\"color: #000000; font-family: \'Times New Roman\'; font-size: medium; font-style: normal; font-variant: normal; letter-spacing: normal; line-height: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-size-adjust: auto; -webkit-text-stroke-width: 0px; font-weight: normal;\"> </strong></p>\r\n<p><strong style=\"color: #000000; font-family: \'Times New Roman\'; font-size: medium; font-style: normal; font-variant: normal; letter-spacing: normal; line-height: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-size-adjust: auto; -webkit-text-stroke-width: 0px; font-weight: normal;\"> </strong></p>\r\n<p><strong id=\"internal-source-marker_0.36245005298405886\" style=\"color: #000000; font-family: \'Times New Roman\'; font-size: medium; font-style: normal; font-variant: normal; letter-spacing: normal; line-height: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-size-adjust: auto; -webkit-text-stroke-width: 0px; font-weight: normal;\"><br /><span style=\"font-size: 15px; font-family: Arial; color: #000000; background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: initial; vertical-align: baseline; white-space: pre-wrap;\"><img src=\"images/blogposts/farmkids/DirtyHands.jpg\" border=\"0\" alt=\"Get your hands dirty\" title=\"A little dirt never hurt anyone\" width=\"225\" height=\"225\" style=\"margin-left: 15px; float: right;\" />Despite getting pretty dirty, my three kids have turned into healthy young adults now. There are many factors that contribute to their good health (genetics, of course -- I have good ones!), but I’ve always thought that one of the reasons they seem to rarely get sick during flu season and don’t have allergies was because they were exposed to allergens and germs at an early age, and their bodies learned how to fight off the bad guys.</span><br /><br /><span style=\"font-size: 15px; font-family: Arial; color: #000000; background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: initial; vertical-align: baseline; white-space: pre-wrap;\">Come to find out, there’s some truth behind that notion. A recent study found that children who grow up on farms see ½ the incidence of asthma and ¼ the incidence of hay fever allergies than children who don’t. Here’s the report: </span><br /></strong></p>\r\n<p><strong style=\"color: #000000; font-family: \'Times New Roman\'; font-size: medium; font-style: normal; font-variant: normal; letter-spacing: normal; line-height: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-size-adjust: auto; -webkit-text-stroke-width: 0px; font-weight: normal;\"> </strong></p>\r\n<p><strong id=\"internal-source-marker_0.36245005298405886\" style=\"color: #000000; font-family: \'Times New Roman\'; font-size: medium; font-style: normal; font-variant: normal; letter-spacing: normal; line-height: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-size-adjust: auto; -webkit-text-stroke-width: 0px; font-weight: normal;\"><br /><span style=\"font-size: 15px; font-family: Arial; color: #000000; background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: initial; vertical-align: baseline; white-space: pre-wrap;\">\"Children Raised On Farms Develop Better Immune Systems\"</span><br /><a href=\"http://www.youtube.com/watch?v=vQ14PEz8stg\" target=\"_blank\" title=\"Children Raised on Farms\"><span style=\"font-size: 15px; font-family: Arial; color: #1155cc; background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: underline; vertical-align: baseline; white-space: pre-wrap;\">http://youtu.be/Ek6QIdYi4wc</span></a><br /><br /><span style=\"font-size: 15px; font-family: Arial; color: #000000; background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: initial; vertical-align: baseline; white-space: pre-wrap;\">And if you’re interested in learning more about how germs interact with our bodies, check out this book by Rob Dunn, “</span><a href=\"http://www.amazon.com/Wild-Life-Our-Bodies-Predators/dp/006180648X\" target=\"_blank\"><span style=\"font-size: 15px; font-family: Arial; color: #1155cc; background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: underline; vertical-align: baseline; white-space: pre-wrap;\">The Wildlife in Our Bodies</span></a><span style=\"font-size: 15px; font-family: Arial; color: #000000; background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: initial; vertical-align: baseline; white-space: pre-wrap;\">.”</span><br /><br /><span style=\"font-size: 15px; font-family: Arial; color: #000000; background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: initial; vertical-align: baseline; white-space: pre-wrap;\">While we can’t all raise our children on a farm, there are still ways to strengthen their immune system with good old-fashioned dirt and grime. Here are a few tips to keep your kids healthy -- with outdoor activity, exercise, and animal interaction: </span><br /><br /><span style=\"font-size: 15px; font-family: Arial; color: #000000; background-color: transparent; font-weight: bold; font-style: normal; font-variant: normal; text-decoration: initial; vertical-align: baseline; white-space: pre-wrap;\">Take a hike! </span><span style=\"font-size: 15px; font-family: Arial; color: #000000; background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: initial; vertical-align: baseline; white-space: pre-wrap;\">Make the kids put down Fruit Ninja and Angry Birds, tie up your walking shoes, and make it out to one of DFW’s many nature trails. Bring a nature diary where your kids can draw pictures and write descriptions of the types of animal tracks, insects, and other wildlife they come across. Start your exploration at the </span><a href=\"http://www.fwnaturecenter.org/index.php?option=com_content&amp;view=article&amp;id=49&amp;Itemid=54\"><span style=\"font-size: 15px; font-family: Arial; color: #1155cc; background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: underline; vertical-align: baseline; white-space: pre-wrap;\">Fort Worth Nature Center and Refuge</span></a><span style=\"font-size: 15px; font-family: Arial; color: #000000; background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: initial; vertical-align: baseline; white-space: pre-wrap;\">, </span><a href=\"http://dfw.cbslocal.com/top-lists/best-hiking-trails-near-dallas/\"><span style=\"font-size: 15px; font-family: Arial; color: #1155cc; background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: underline; vertical-align: baseline; white-space: pre-wrap;\">Dinosaur Valley State Park</span></a><span style=\"font-size: 15px; font-family: Arial; color: #000000; background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: initial; vertical-align: baseline; white-space: pre-wrap;\"> in Glen Rose, or </span><a href=\"http://www.texasoutside.com/hikebike/BreckinridgeFrames.htm\"><span style=\"font-size: 15px; font-family: Arial; color: #1155cc; background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: underline; vertical-align: baseline; white-space: pre-wrap;\">Breckenridge Park</span></a><span style=\"font-size: 15px; font-family: Arial; color: #000000; background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: initial; vertical-align: baseline; white-space: pre-wrap;\"> in Richardson. </span><br /><span style=\"font-size: 15px; font-family: Arial; color: #000000; background-color: transparent; font-weight: bold; font-style: normal; font-variant: normal; text-decoration: initial; vertical-align: baseline; white-space: pre-wrap;\">Adopt a dog or a cat</span><span style=\"font-size: 15px; font-family: Arial; color: #000000; background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: initial; vertical-align: baseline; white-space: pre-wrap;\"> - Growing up with animals has a lot of benefits, not least of which is a defense against pet allergies. When you introduce animals to your home while your child is young, they’re less likely to develop fur and dander-related respiratory issues as they grow up. Visit the </span><a href=\"http://dognkittycity.org/\"><span style=\"font-size: 15px; font-family: Arial; color: #1155cc; background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: underline; vertical-align: baseline; white-space: pre-wrap;\">Humane Society</span></a><span style=\"font-size: 15px; font-family: Arial; color: #000000; background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: initial; vertical-align: baseline; white-space: pre-wrap;\"> and bring home a four-legged, furry family member. It’s good for your health </span><span style=\"font-size: 15px; font-family: Arial; color: #000000; background-color: transparent; font-weight: normal; font-style: italic; font-variant: normal; text-decoration: initial; vertical-align: baseline; white-space: pre-wrap;\">and</span><span style=\"font-size: 15px; font-family: Arial; color: #000000; background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: initial; vertical-align: baseline; white-space: pre-wrap;\"> your happiness :) </span><br /><span style=\"font-size: 15px; font-family: Arial; color: #000000; background-color: transparent; font-weight: bold; font-style: normal; font-variant: normal; text-decoration: initial; vertical-align: baseline; white-space: pre-wrap;\">Summer camp - </span><span style=\"font-size: 15px; font-family: Arial; color: #000000; background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: initial; vertical-align: baseline; white-space: pre-wrap;\">Instead of playing video games and watching TV over the summer, sign your kids up for an outdoor, interactive summer program. There are a few in the DFW, including our own </span><a href=\"http://petsupervisor.com/index.php/services/critter-camp\"><span style=\"font-size: 15px; font-family: Arial; color: #1155cc; background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: underline; vertical-align: baseline; white-space: pre-wrap;\">Critter Camp</span></a><span style=\"font-size: 15px; font-family: Arial; color: #000000; background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: initial; vertical-align: baseline; white-space: pre-wrap;\">. Also check out the </span><a href=\"http://www.dallaszoo.com/education/camps-classes/summer-camp/\"><span style=\"font-size: 15px; font-family: Arial; color: #1155cc; background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: underline; vertical-align: baseline; white-space: pre-wrap;\">Dallas Zoo’s day camp</span></a><span style=\"font-size: 15px; font-family: Arial; color: #000000; background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: initial; vertical-align: baseline; white-space: pre-wrap;\">, the </span><a href=\"http://www.brit.org/webfm_send/128\"><span style=\"font-size: 15px; font-family: Arial; color: #1155cc; background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: underline; vertical-align: baseline; white-space: pre-wrap;\">Botanical Research Institute of Texas’ programs</span></a><span style=\"font-size: 15px; font-family: Arial; color: #000000; background-color: transparent; font-weight: bold; font-style: normal; font-variant: normal; text-decoration: initial; vertical-align: baseline; white-space: pre-wrap;\">, </span><span style=\"font-size: 15px; font-family: Arial; color: #000000; background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: initial; vertical-align: baseline; white-space: pre-wrap;\">and the </span><a href=\"http://www.riverlegacy.org/component/content/article/168.html\"><span style=\"font-size: 15px; font-family: Arial; color: #1155cc; background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: underline; vertical-align: baseline; white-space: pre-wrap;\">River Legacy’s summer nature adventures.</span></a><br /><span style=\"font-size: 15px; font-family: Arial; color: #000000; background-color: transparent; font-weight: bold; font-style: normal; font-variant: normal; text-decoration: initial; vertical-align: baseline; white-space: pre-wrap;\">Gardening </span><span style=\"font-size: 15px; font-family: Arial; color: #000000; background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: initial; vertical-align: baseline; white-space: pre-wrap;\">- Let the kids get their hands in the dirt by starting a garden in the backyard. Even if you don’t have a green thumb, there are plenty of ways to get started with gardening as a beginner and even more ways to get your kids involved. Start with an herb garden on your porch, or a raised bed. </span><a href=\"http://www.huffingtonpost.com/2012/05/29/edible-garden-tips-gardening_n_1553106.html\"><span style=\"font-size: 15px; font-family: Arial; color: #1155cc; background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: underline; vertical-align: baseline; white-space: pre-wrap;\">Here are a couple of tips for breaking ground</span></a><span style=\"font-size: 15px; font-family: Arial; color: #000000; background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: initial; vertical-align: baseline; white-space: pre-wrap;\">! </span><br /><span style=\"font-size: 15px; font-family: Arial; color: #000000; background-color: transparent; font-weight: bold; font-style: normal; font-variant: normal; text-decoration: initial; vertical-align: baseline; white-space: pre-wrap;\">Raise backyard chickens. </span><span style=\"font-size: 15px; font-family: Arial; color: #000000; background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: initial; vertical-align: baseline; white-space: pre-wrap;\">Have your kids collect eggs and clean out the coop. Even if there’s not a direct correlation between mucking out stalls and the health of your kids, they’ll still learn responsibility and maturity as they raise the chickens, and your whole family will be able to enjoy farm-fresh eggs from healthy, happy chickens. There are plenty of ways to get started with raising chickens in your backyard. This website is a great resource: </span><a href=\"http://www.backyardchickens.com/a/how-to-raise-backyard-chickens-in-your-city-the-basics-of-raising-chickens\"><span style=\"font-size: 15px; font-family: Arial; color: #1155cc; background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: underline; vertical-align: baseline; white-space: pre-wrap;\">Raising chickens!</span></a><br /><br /><span style=\"font-size: 15px; font-family: Arial; color: #000000; background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: initial; vertical-align: baseline; white-space: pre-wrap;\">How else do you keep your kids healthy and active? Leave us a comment below and let us know! </span><br /><br /><span style=\"font-size: 15px; font-family: Arial; color: #000000; background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: initial; vertical-align: baseline; white-space: pre-wrap;\">Hugs and Critters,</span><br /><span style=\"font-size: 15px; font-family: Arial; color: #000000; background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: initial; vertical-align: baseline; white-space: pre-wrap;\">Cathy </span></strong></p>','',1,17,'2013-02-23 01:58:43',87,'2013-03-15 19:56:02',42,'2013-03-15 19:55:48','0000-00-00 00:00:00','{\"alternative_readmore\":\"\"}',5,0,0,'','',1,117,'{\"metakey\":\"\",\"metadesc\":\"\",\"page_image\":\"\",\"ogdesc\":\"\"}','*',0);
INSERT INTO `cc1_joomblog_posts` VALUES (11,117,'Seeking volunteers','seeking-volunteers-to-milk-goats','<p><span class=\"userContent\"><img src=\"images/crittercamp/goatmilking.jpg\" border=\"0\" width=\"200\" height=\"150\" style=\"margin-left: 10px; margin-right: 10px; float: left;\" />At Cathy\'s Critters, we are a home to dairy goats that produce, in their peak, about 2-4 gallons of milk per day. This is way more than our family can use, even if I had time to make cheese every day (which would be awesome, but I don\'t). We don\'t even have room in our refrigerators and freezers to store all of it! <br /> <br /> The state of Texas and the federal government (USDA) has strict rules about qua<span class=\"text_exposed_show\">lifying as a Grade A dairy and selling milk directly from the farm. We are not interested in becoming a dairy right now (maybe someday), but really enjoy caring for the animals and sharing their delicious milk with friends.<br /> <br /> That\'s where you come in. We are seeking volunteers to exchange their time (an hour a week or so) for fresh milk. <br /> <br /> We don\'t assume anyone has experience with this, so we provide training and flexible volunteer schedules (mornings only, but time is not too important - anywhere from 7 am to about 10 am at your convenience). You\'ll probably be an expert in about 1-2 training sessions. We\'ve had men, women, teenagers, stay-at-home moms, even a working TV actress on our volunteer roster! <br /> <br /> It\'s a great experience and goes hand-in-hand with our corporate mission at HAIEA (Human-Animal Interaction and Education Advocates), which is to help people share their lives with animals in ways the foster responsibility, empathy, and a sense of connectedness to the natural world.<br /> <br /> We can start you on a weekend or weekday any time as soon as tomorrow. Please contact me (Kevin) or leave a message at the office with Lisa if you\'d like to get scheduled for milking training and start enjoying raw milk.</span></span></p>\r\n<p><span class=\"userContent\"><span class=\"text_exposed_show\">Kevin: 972-841-3897 or kevin at cathys dash critters dot com<br /></span></span></p>\r\n<p><span class=\"userContent\"><span class=\"text_exposed_show\">Lisa: 972-562-0583 or reservations at cathys dash critters dot com<br /></span></span></p>','',1,17,'2013-03-15 19:58:23',55,'0000-00-00 00:00:00',0,'2013-03-15 20:01:58','0000-00-00 00:00:00','{\"alternative_readmore\":\"\"}',1,0,0,'','',1,123,'{\"metakey\":\"\",\"metadesc\":\"\",\"page_image\":\"\",\"ogdesc\":\"\"}','*',0);
INSERT INTO `cc1_joomblog_posts` VALUES (12,118,'Goat talent available','cassidy-on-film','<p><img src=\"images/goat_in_waiting_small.jpg\" border=\"0\" width=\"127\" height=\"171\" style=\"float: left; margin-left: 10px; margin-right: 10px;\" />Our newest film star at Cathy\'s Critters is \"Cassidy\", a 2-year-old nigerian dwarf goat with serious film cred.  Remember the \"Goat For Sale\" Doritos commercial from this year\'s Super Bowl?  Well, a local company was interested in doing a parody of it for an employee meeting in which employees made self-produced videos to introduce themselves to the team.  Turns out they have an employee who was a dead ringer for the bearded fellow in the original commercial who starts an ill-fated relationship with a goat who has a massive appetite for Doritos.  Meet Chris and Cassidy.</p>\r\n<p> </p>\r\n<p> </p>\r\n<p> </p>\r\n<p> </p>\r\n<p><img src=\"images/goat_on_lawn_small.jpg\" border=\"0\" width=\"195\" height=\"146\" style=\"margin-left: 10px; margin-right: 10px; float: right;\" />This was a lot of fun, and don\'t worry.  There were no Doritos in the bag Cassidy was eating out of.  She was too smart for that.  One sniff and she said she preferred her usual grain, so that\'s what\'s in her bag :-).</p>\r\n<p> </p>\r\n<p> </p>\r\n<p><iframe src=\"http://www.youtube.com/embed/tiVTe5N_6CU\" frameborder=\"0\" width=\"425\" height=\"350\"></iframe></p>\r\n<p> </p>','',1,17,'2013-03-22 20:50:22',55,'2013-03-22 23:05:27',42,'2013-03-22 20:50:24','0000-00-00 00:00:00','{\"alternative_readmore\":\"\"}',7,0,0,'','',1,91,'{\"metakey\":\"\",\"metadesc\":\"\",\"page_image\":\"\",\"ogdesc\":\"\"}','*',0);
INSERT INTO `cc1_joomblog_posts` VALUES (13,119,'Sydney Escapes','sydney-escapes','<p><img src=\"images/banner/GirlWithWallaby_Cropped.jpg\" border=\"0\" alt=\"Sydney the wallaby\'s new friend\" width=\"512\" height=\"171\" /></p>\r\n<p>1:00 am, Tuesday morning.  <br />From sound sleep, Cathy\'s voice enters consciousness \"Kevin! Come here!\".  I spring awake, body before brain.  Pants are by the bed as usual, and I reflexively pull them on, then my tennis shoes.  It\'s cold outside, but I don\'t take time to find a shirt in the dark.  By the time I\'ve hit the door Cathy has explained \"The dogs are barking.  The kangaroos are out or something.  we must have left a gate open.\"  Going through my mental checklist (could this be my fault?) I distinctly remember chaining the main front gate, a new habit I\'ve had to adopt since our dog started to explore our neighbors\' trash, and that I\'m trying in vain to get everyone else to adopt.  Next mental checklist item is the door to the activity room, which stands between the outback and the yard where the dogs were barking, and where, apparently, Sydney the Wallaby was found (and was now in the house).<br /><br />It\'s cold outside with no shirt.  I\'m here before I really know what we\'re doing.  I\'m thinking we\'re going to find two, 120-pound kangaroos in our yard and spend the next 20-30 minutes chasing them, ending in carrying the exhausted and possibly not-ready-to-be-carried Australian bunny rabbits back to their side of the gate, known around here as \"The Outback\".  Cathy has the flashlight and is ahead of me.  She\'s thinking out loud and says \"maybe Sydney got out while I had my back to the gate when I was feeding the babies.  The babies are the young lambs and goats that live in the outback with the roos and the emu.  They are taken from their mothers to be bottle fed if their mothers aren\'t doing a good job nursing, or have more kids than they can feed.  In the old, politically correct days of farming, these were called \"runts\" and met the axe.  Here at Cathy\'s Critters, everybody gets a chance. <br /><br />We\'re stalking through medium length grass, wet with frosty dew which is dampening my pants\' cuffs and making it colder.  I\'m no longer worried that we\'ll be chasing kangaroos, since it appears that Syndney was the only escape artist.  Cathy is still not so sure, swepping the light along the fence line repeating \"they\'re not here... they\'re not here\".  \"They usually sleep over here.  Relax\", I say, fulling expecting to see their prone figures any second, ears perked from our arrival.  And, boom, there they are, one asleep and one awake by the old red chicken house. <br /><br />The chicken house is not used for chickens any more.  Actually, even when it was used for chickens it wasn\'t very good at it.  It\'s about 4\' by 6\' and tall enough to walk into if you stoop a little.  Just about the size of a luxurious outhouse.  The funny part about this chicken house is that it\'s built on a tiny concrete slab - probably the smallest foundation we ever made - and so despite its hastily thrown-together framing job, it\'s still standing straight and level as the day we built it.  But it\'s still too small to be of any use except for the occasional napping piglet or kangaroo.  Why is it starting to sound like a Winnie the Pooh adventure around here?  I think the only residents of 100 acre wood we don\'t have on a regular basis would be an owl who can almost spell and a curious, grateful bear with a good heart and a head full of fluff.  Never mind, I think I\'ve got both of those characters covered.<br /><br />Cathy is not done worrying yet (she\'d be \"Rabbit\").  \"You know who\'s missing?\", she intones.  \"The emu\", she replies, without waiting for me to ask \"Who?\"  I suggest that he\'ll be on the other side of the outback where he usually sleeps.  We start striding back, my amusement has completely replaced any sense of panic or urgency by this point, and the fact that I\'m out in 40 degree night chill with no shirt on is coming more to the front of mind.  She sweeps the flashlight over the old fallen tree trunk (too big to move, gives the place character, I say).  I have her stop and go back to it.  Never mind, the trunk looks like an emu tonight.  Then, a large teardrop-shaped mound along the fence line.  Yup that\'s him.  Alive?  Yup. Head\'s up and he\'s watching us curiously.  He decides not to get up - he\'s seen stranger. <br /><br />1:05 am.<br />I make a bee-line to the door, remove shoes and pants, put them back on the floor between the bed and the wall, and crawl into bed to write this memory down while it\'s fresh.  Cathy is still making a final sweep of getting everyone where they belong.  Cats out?  Check.  Jazz and Pepper in?  Check.  Oh, Jazz has gas tonight - not sleeping in our room tonight.<br /><br />1:45 am.  Posting to the blog.<br /><br /></p>\r\n<p>If you enjoyed this, please comment with a story about when *you* were worried about a pet.  Hopefully yours turned out fine also.</p>\r\n<p>Love,</p>\r\n<p>Kevin and Cathy</p>\r\n<p>CathysCritters.com</p>\r\n<p>HAIEA.org</p>','',1,17,'2013-03-26 06:48:44',55,'2013-03-27 14:47:58',42,'2013-03-26 06:55:53','0000-00-00 00:00:00','{\"alternative_readmore\":\"\"}',3,0,0,'','',1,219,'{\"metakey\":\"\",\"metadesc\":\"\",\"page_image\":\"\",\"ogdesc\":\"\"}','*',0);
